INSERT INTO `arf_about` VALUES (1,'Sejarah INI','BPR ADIPURA SANTOSA','yes','WhatsApp Image 2017-04-06 at 07.02.15.jpeg','<p style=\"text-align: justify;\">\r\n	Masa Pemerintahan Hindia Belanda</p>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	Bermula dari Pemerintahan Hindia Belanda, INI merupakan perkumpulan yang tujuannya sebagai ajang pertemuan dan bersilaturahmi antara para Notaris yang menjadi anggotanya (perkumpulan satu-satunya bagi notaris Indonesia ).</p>\r\n<p style=\"text-align: justify;\">\r\n	Dan berdasarkan Broederschap van Candidaat-Notarissen in Nederlanden zijne Kolonien&#39; dan Broederschap der Notarissen di Negeri Belanda, diakui sebagai badan hukum (rechtspersoon) dengan Gouvernements Besluit (Penetapan Pemerintah) tgl. 05 Sept. 1908 No. 9.&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	De-Nederlandsch Indische Notarieele Vereeniging - Batavia (sekarang Jakarta) Tgl. 01 Juli 1908 (Anggaran Dasar Ex Menteri Kehakiman,Tgl. 04 Desember 1958 No. J.A. 5/117/6).</p>\r\n<p style=\"text-align: justify;\">\r\n	Pada masa itu Pengurus notaris berkebangsaan Belanda yaitu LM.Van Sluijters, E.H. Carpentir Alting, H.G. Denis, H.W. Roebey, W. an Der Meer dan Anggota Perkumpulan terdiri dari Notaris dan Calon Notaris Indonesia (pada waktu itu Nederlandsch Indie).</p>\r\n<p style=\"text-align: justify;\">\r\n	Masa Kemerdekaan Rl</p>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	Notaris Indonesia yang tergabung dalam perkumpulan lama tersebut, diwakili seorang pengurus selaku ketuanya, Notaris ELIZA PONDAAG mengajukan Permohonan kepada Pemerintah c.q. Menteri Kehakiman Republik Indonesia dgn suratnya tgl.&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	17 November 1958 untuk mengubah Anggaran Dasar (statuten) perkumpulan itu dan berdasarkan Putusan Mahkamah Konstitusi Rl No: 009-014/PUU-III/2005, tgl. 13 Sept. 2005 dan Putusan MK Rl No: 63/PUU-II/2014, telah menolak uji materi atas Pasal 82 UU Jabatan Notaris dan karenanya mengukuhkan kedudukan IKATAN NOTARIS INDONESIA sebagai satu-satunya wadah organisasi Notaris.</p>\r\n<p style=\"text-align: justify;\">\r\n	I.N.I. resmi tergabung dalam keanggota ke-66 dari Organisasi Notaris Latin International (InternationalUnion ofLatinNotaries - UINL) tanggal 30 Mei 1997 di Santo Dominggo, Dominica.</p>\r\n','profil-2-Sejarah.INI.html','2016-10-25 17:10:38','2019-12-10 11:18:55'),(2,'Visi dan Misi','BPR ADIPURA SANTOSA','yes','slide1(4).jpg','<p style=\"text-align: justify;\">\r\n	MEMBANGUN ORGANISASI INI MELALUI KEPENGURUSAN PENGWIL INI JATENG<br />\r\n	Oleh:<br />\r\n	Dr.Widhi Handoko, SH., SpN.<br />\r\n	Notaris PPAT Kota Semarang<br />\r\n	Dosen Doktoral Ilmu Kepolisian (PTIK-STIK POLRI).<br />\r\n	Dosen MKn Undip &amp; Unissula Smg.<br />\r\n	<br />\r\n	Sudah selayaknya sebuah organisasi ditingkat Pengwil INI Jateng, mendukung dan melaksanakan tercapainya visi misi INI secara nasional, sebagai pedoman mencapai arah visi misi pada relnya. Adapun Visi misi INI secara nasional yaitu:<br />\r\n	<br />\r\n	VISI<br />\r\n	&ldquo;Memantapkan Ikatan Notaris Indonesia sebagai satu-satunya wadah untuk membangun KEBANGGAAN berorganisasi &amp; KEJAYAAN NOTARIS.&rdquo;<br />\r\n	&nbsp;<br />\r\n	MISI<br />\r\n	Meningkatkan Integritas &amp; Perlindungan Anggota dengan :</p>\r\n<ol>\r\n	<li style=\"text-align: justify;\">\r\n		Meningkatkan pengetahuan keilmuan &amp; ke-organisasian serta bersinergi dengan lembaga pendidikan profesi</li>\r\n	<li style=\"text-align: justify;\">\r\n		Memperkuat fungsi kesekretariatan &amp; penyempurnaan sistem administrasi keanggotaan</li>\r\n	<li style=\"text-align: justify;\">\r\n		Bersinergi dengan IPPAT, asosiasi/lembaga yang terafiliasi dengan profesi &amp; seluruh Lembaga Pemerintahan</li>\r\n	<li style=\"text-align: justify;\">\r\n		Membangun kerjasama yang baik dengan Kepolisian &amp; Kejaksaan</li>\r\n	<li style=\"text-align: justify;\">\r\n		Mengoptimalkan organisasi dalam melindungi anggota untuk mencapai KEBANGGAAN BERORGANISASI dan KEJAYAAN NOTARIS</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	Dari keseluruhan. Visi misi INI secara nasional, maka secara organisatoris penting kiranya calon ketua Pengwil INI Jateng, mendukung dan mengacu standar, serta arah yang sudah ditegaskan oleh PP INI.<br />\r\n	<br />\r\n	Namun demikian tidak ada salahnya jika seorang leadersip atau calon ketua Pengwil INI Jateng, memiliki kompetensi dan mampu menunjukan kreatifitas dan implementatif yang efektif dan rasional dalam mewujudkan visi misi tersebut. Sekaligus seorang calon ketua harus mampu memberikan pengembangan dan pemberdayaan visi misi INI secara progresif dan visioner untuk diejawantahkan (diwujudkan/diimplementasikan) yang lebih baik dan berkemajuan.<br />\r\n	<br />\r\n	Widhi Handoko sebagai salah satu calon ketua Pengwil INI Jateng, secara visioner memberikan gambaran yang tegas dan jelas untuk mewujudkan visi misi INI secara nasional sekaligus mewujudkan visi misi ditingkat Pengwil INI Jateng sebagai berikut:</p>\r\n<ol>\r\n	<li style=\"text-align: justify;\">\r\n		Penataan struktural scr internal (Membagi bidang sesuai kompetensi)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Penguatan kerjasama antar lembaga (MoU dengan Polri, Kejaksaan, Pemda, Perbankan dan juga Prodi MKn serta institusi lain terkait, untuk menegaskan hak kewajiban kerjasama yg harmonis dan berkelanjutan)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Transparansi pengelolaan organisasi (Memperkuat fungsi kesekretariatan &amp; penyempurnaan sistem administrasi keanggotaan, dengan melakukan tertib administrasi &amp; keuangan)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Kegiatan ilmiah dan pendidikan (Melakukan kegiatan yg terfokus pada up date pengetahuan keahlian dan kemahiran pembuatan akta. Penyusunan buku pedoman standar akta Notariil PPAT, sekaligus mensinergikan kegiatan dengan pengwil IPPAT Jateng)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Membangun capacity building (Melakukan penguatan tupoksi SDM scr integral&nbsp; dengan pengda-pengda INI sejawa tengah, lebih mengutamakan pembangunan revolusi mental terkait penguatan etika morelity dan religus sbg integritas pondasi organisasi untuk mengembalikan serta menjaga harkat, martabat dan kehormatan. Sekaligus menguatkan loyalitas anggota terhadap organisasi, menghargai anggota dan memberikan hak-hak anggota akan membawa dampak positif terhadap organisasi)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Pengayoman anggota yang mendapat masalah (Melakukan pendampingan dan memberikan bantuan hukum secara serius kepada anggota yang terkena masalah dalam melaksanakan tugas dan kewajiban sbg Notaris)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Pemberdayaan kegiatan olah raga dan seni (Melakukan kegiatan-kegiatan olah raga dan seni, yg selama ini sudah berjalan ditingkatkan dg giat-giat yg lebih bernuansa keakraban dan keharmonisan)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Pengembangan bidang usaha yg memungkin terealisasi (Melakukan penjajakan dan pendayagunaan bidang usaha yg berorientasi pada kemajuan organisasi, yg dapat direalisasikan, baik dalam jangka menengah atau jangka panjang, guna menunjang kemandirian dan keberlangsungan masa depan organisasi)</li>\r\n	<li style=\"text-align: justify;\">\r\n		Membentuk Yayasan Sosial INI (Melakukan dan mensinergikan kegiatan sosial, pendidikan dan budaya melalui badan hukum Yayasan di bawah naungan INI Pengwil Jateng)</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	Dari 9 visi misi tersebut setiap saat dapat dilakukan evaluasi untuk mendengarkan aspirasi (masukan dan kritik atau saran) para anggota, semua ditujukan untuk persatuan dan keharmonisan jalannya organisasi, serta tercapainya visi misi demi kemajuan dan masa depan organisasi INI.</p>\r\n','profil-6-Sejarah.IPPAT.Jateng.html','2019-12-10 13:36:48','2017-04-10 10:50:59'),(3,'Susunan Pengurus','','yes','','<p>\r\n	<strong>SUSUNAN PENGURUS WILAYAH JAWA TENGAH IK