INSERT INTO `arf_alb` VALUES (1,'Seleksi Anggota Luar Biasa 21 Februari 2020','no','IMG-20200108-WA0011.jpg','2020-02-19','<p>\r\n	<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.<br />\r\n	* Data fisik dibawa saat hari H.<br />\r\n	* Dress code</p>\r\n<ul>\r\n	<li>\r\n		Pria : Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu.</li>\r\n	<li>\r\n		Wanita : Baju putih (berkerah dan berlengan) rok hitam minimal selutut dan bersepatu (jilbab hitam)</li>\r\n</ul>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n','2020-03-20 09:54:31','0000-00-00 00:00:00'),(2,'Seleksi Anggota Luar Biasa Pengwil Jateng INI periode mei 2020 Tgl 5 Mei 2020','no','WhatsApp Image 2020-02-29 at 18.39.59.jpeg','2020-03-19','<p style=\"text-align: justify;\">\r\n	Seleksi Anggota Luar Biasa Pengwil Jateng INI periode mei 2020 Tgl 5 Mei 2020 di R. Poncowati hotel Patra Semarang</p>\r\n<p>\r\n	<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.<br />\r\n	* Data fisik dibawa saat hari H.<br />\r\n	* Dress code</p>\r\n<ul>\r\n	<li>\r\n		Pria : Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu.</li>\r\n	<li>\r\n		Wanita : Baju putih (berkerah dan berlengan) rok hitam minimal selutut dan bersepatu (jilbab hitam)</li>\r\n</ul>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n','2020-03-20 09:56:10','0000-00-00 00:00:00'),(3,'Seleksi Anggota Luar Biasa Pengwil Jateng INI periode Agustus 2020','no','ALB.png','2020-08-01','<p style=\"text-align: justify;\">\r\n	Seleksi Anggota Luar Biasa Pengwil Jateng INI periode Agustus 2020 akan dilaksanakan sekitar akhir agustus 2020 di Resto Alam Indah Jl Setiabudi 12 Semarang</p>\r\n<p>\r\n	<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.<br />\r\n	* Data fisik dibawa saat hari H.<br />\r\n	* Dress code</p>\r\n<ul>\r\n	<li>\r\n		Pria : Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu hitam.</li>\r\n	<li>\r\n		Wanita : Baju putih (berkerah dan berlengan) rok hitam minimal selutut dan bersepatu hitam (jilbab hitam)</li>\r\n</ul>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n<p>\r\n	* Peserta dilarang menggunakan kendaraan pribadi ke tempat acara</p>\r\n<p>\r\n	* Peserta wajib menggunakan masker, face shield, dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	<strong>Syarat dan ketentuan</strong> <strong>mengikuti ALB dan Magang Bersama Periode Agustus 2020 Pengwil Jateng INI</strong> :</p>\r\n<p>\r\n	1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon Peserta yang namanya tercantum dalam daftar dibawah ini wajib mengisi&nbsp; link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal &nbsp;31 Juli 2020. Pukul 24.00 WIB</p>\r\n<p>\r\n	2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon Peserta tersebut dalam angka 1,&nbsp; yang mengisi link lebih dari 31 Juli 2020 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode Agustus baru dapat mengikuti periode Agustus.</p>\r\n<p>\r\n	3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu.</p>\r\n<p>\r\n	Apabila masih ada kuota, dapat mengikuti kegiatan bulan Agustus. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu&nbsp; periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n<p>\r\n	4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan ALB dan Magber periode Agustus akan dibagi dalam kelas-kelas &nbsp;yang akan diumumkan&nbsp; maksimal &nbsp;10 Agustus 2020.</p>\r\n<p>\r\n	5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon peserta yang berasal dari luar Jawa Tengah (sesuai KTP) wajib membawa bukti Rapid Test maksimal &nbsp;H-2 dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia. Peserta dr luar Jawa Tengah yang telah berdomisili di Jawa Tengah dapat dibuktikan dengan telah mengikuti magang di kantor Notaris yang berada di Jawa Tengah sejak minimal 6 bulan yang lalu</p>\r\n<p>\r\n	6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peserta dilarang membawa kendaraan sendiri.</p>\r\n<p>\r\n	7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan&nbsp; ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37 atau sedang flu/batuk, panitia berhak utk mengundur pelaksanaan peserta tersebut utk ikut pada pelaksanaan periode berikutnya dan uang yg telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n<div>\r\n	8. Semua data yang diupload harus dari berkas asli atau apabila fotocopy hrs ada legalisir notaris dan jelas terbaca. Data yang diupload hrs berupa scan tidak diperkenankan dari foto kamera.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<p>\r\n	Hal-hal &nbsp;yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ttd</p>\r\n<p>\r\n	Panitia Pelaksana</p>\r\n<p>\r\n	&nbsp;</p>\r\n<div>\r\n	<p>\r\n		<strong>Data Peserta Seleksi ALB&nbsp;</strong></p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;Peserta ALB :</p>\r\n	<p>\r\n		1.&nbsp;&nbsp;&nbsp;&nbsp; Abdullah Jamaludin</p>\r\n	<p>\r\n		2.&nbsp;&nbsp;&nbsp;&nbsp; Achmad Budiman</p>\r\n	<p>\r\n		3.&nbsp;&nbsp;&nbsp;&nbsp; Alya Bella Tarusita</p>\r\n	<p>\r\n		4.&nbsp;&nbsp;&nbsp;&nbsp; Andy lie&nbsp;</p>\r\n	<p>\r\n		5.&nbsp;&nbsp;&nbsp;&nbsp; Anviresta Guswaninginchia</p>\r\n	<p>\r\n		6.&nbsp;&nbsp;&nbsp;&nbsp; Apit Rina Palupi</p>\r\n	<p>\r\n		7.&nbsp;&nbsp;&nbsp;&nbsp; Bambang Suprayogi</p>\r\n	<p>\r\n		8.&nbsp;&nbsp;&nbsp;&nbsp; Didi Kurniawan Bambang, A.P., S.H.,&nbsp;M.Kn,</p>\r\n	<p>\r\n		9.&nbsp;&nbsp;&nbsp;&nbsp; Didik Agung Sulistyo</p>\r\n	<p>\r\n		10.&nbsp;&nbsp; EKO NURHANAFI</p>\r\n	<p>\r\n		11.&nbsp;&nbsp; Eunike selend s.</p>\r\n	<p>\r\n		12.&nbsp;&nbsp; Fitria Handayani Hayu U</p>\r\n	<p>\r\n		13.&nbsp;&nbsp; Herdiani Anggraina S&nbsp;</p>\r\n	<p>\r\n		14.&nbsp;&nbsp; Himawan G.P.</p>\r\n	<p>\r\n		15.&nbsp;&nbsp; Idris bahtiyyar</p>\r\n	<p>\r\n		16.&nbsp;&nbsp; Ikhwan Jaya, SH,Mkn&nbsp;</p>\r\n	<p>\r\n		17.&nbsp;&nbsp; Indah Nailal Muna</p>\r\n	<p>\r\n		18.&nbsp;&nbsp; Justitia Resalane</p>\r\n	<p>\r\n		19.&nbsp;&nbsp; Lelly Kurniawati</p>\r\n	<p>\r\n		20.&nbsp;&nbsp; Leni Puji Lestari</p>\r\n	<p>\r\n		21.&nbsp;&nbsp; Leonardo Jati Kusuma Wardoyo&nbsp;</p>\r\n	<p>\r\n		22.&nbsp;&nbsp; Meta Budiani</p>\r\n	<p>\r\n		23.&nbsp;&nbsp; Millatina Mahardini</p>\r\n	<p>\r\n		24.&nbsp;&nbsp; Monica Gainifer H S&nbsp;</p>\r\n	<p>\r\n		25.&nbsp;&nbsp; Muhammad Hafid Adhi Nugraha</p>\r\n	<p>\r\n		26.&nbsp;&nbsp; Muhammad Hakiki Dharmawan&nbsp;</p>\r\n	<p>\r\n		27.&nbsp;&nbsp; Muhammad Syihabudin&nbsp;</p>\r\n	<p>\r\n		28.&nbsp;&nbsp; Nicholas samuel</p>\r\n	<p>\r\n		29.&nbsp;&nbsp; Nurul Insani Istiqla</p>\r\n	<p>\r\n		30.&nbsp;&nbsp; Olga Puspita Dewi</p>\r\n	<p>\r\n		31.&nbsp;&nbsp; Puspita Jian Andrina&nbsp;</p>\r\n	<p>\r\n		32.&nbsp;&nbsp; Rachmat dwi hendratno</p>\r\n	<p>\r\n		33.&nbsp;&nbsp; Ridlo Nur Cahyo</p>\r\n	<p>\r\n		34.&nbsp;&nbsp; Siswari, SH,MKn</p>\r\n	<p>\r\n		35.&nbsp;&nbsp; Sukma Putri Sulistyaningrum&nbsp;</p>\r\n	<p>\r\n		36.&nbsp;&nbsp; Wahyu tri yuliana</p>\r\n	<p>\r\n		37.&nbsp;&nbsp; Yedija Eka Bella Bertty&nbsp;</p>\r\n	38.&nbsp; &nbsp; Yulfitri Nurjanah</div>\r\n','2020-10-16 16:44:45','0000-00-00 00:00:00'),(4,'Seleksi Anggota Luar Biasa Pengwil Jateng INI periode November 2020','no','alb fix.png','2020-11-11','<p>\r\n	Seleksi Anggota Luar Biasa Pengwil Jateng INI periode November 2020 akan dilaksanakan pada tanggal 16 November 2020 di Resto Alam Indah Jl Setiabudi 12 Semarang</p>\r\n<p>\r\n	<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.<br />\r\n	* Data fisik dibawa saat hari H.<br />\r\n	* Dress code</p>\r\n<ul>\r\n	<li>\r\n		Pria : Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu hitam.</li>\r\n	<li>\r\n		Wanita : Baju putih (berkerah dan berlengan) rok hitam minimal selutut dan bersepatu hitam (jilbab hitam)</li>\r\n</ul>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n<p>\r\n	* Peserta dilarang menggunakan kendaraan pribadi ke tempat acara</p>\r\n<p>\r\n	* Peserta wajib menggunakan masker, face shield, dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	<strong>Syarat dan ketentuan</strong>&nbsp;<strong>mengikuti ALB dan Magang Bersama Periode November 2020 Pengwil Jateng INI</strong>&nbsp;:</p>\r\n<p>\r\n	1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon Peserta yang namanya tercantum dalam daftar dibawah ini wajib mengisi&nbsp; link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal&nbsp; 10 November 2020. Pukul 23.59 WIB</p>\r\n<p>\r\n	2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon Peserta tersebut dalam angka 1,&nbsp; yang mengisi link lebih dari 10 November 2020 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode November baru dapat mengikuti periode November.</p>\r\n<p>\r\n	3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu.</p>\r\n<p>\r\n	Apabila masih ada kuota, dapat mengikuti kegiatan bulan November. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu&nbsp; periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n<p>\r\n	4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan ALB dan Magber periode November akan dibagi dalam kelas-kelas &nbsp;yang akan diumumkan&nbsp; maksimal &nbsp;13 November 2020.</p>\r\n<p>\r\n	5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon peserta yang berasal dari luar Jawa Tengah (sesuai KTP) wajib membawa bukti Rapid Test maksimal &nbsp;H-2 dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia. Peserta dr luar Jawa Tengah yang telah berdomisili di Jawa Tengah dapat dibuktikan dengan telah mengikuti magang di kantor Notaris yang berada di Jawa Tengah sejak minimal 6 bulan yang lalu</p>\r\n<p>\r\n	6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peserta dilarang membawa kendaraan sendiri.</p>\r\n<p>\r\n	7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan&nbsp; ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37 atau sedang flu/batuk, panitia berhak utk mengundur pelaksanaan peserta tersebut utk ikut pada pelaksanaan periode berikutnya dan uang yg telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n<p>\r\n	8. Semua data yang diupload harus dari berkas asli atau apabila fotocopy hrs ada legalisir notaris dan jelas terbaca. Data yang diupload hrs berupa scan tidak diperkenankan dari foto kamera.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Hal-hal &nbsp;yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ttd</p>\r\n<p>\r\n	Panitia Pelaksana</p>\r\n','2021-01-18 10:27:43','0000-00-00 00:00:00'),(5,'Seleksi Anggota Luar Biasa Pengwil Jateng INI periode Februari 2021','no','alb februari.png','2021-02-13','<p>\r\n	Seleksi Anggota Luar Biasa Pengurus wilayah Jawa Tengah INI periode Februari 2021 akan dilaksanakan pada tanggal 17 Februari 2021 di The Sunan Hotel Solo</p>\r\n<p>\r\n	Penting harap menjadi perhatian setiap peserta</p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n<p>\r\n	* Data fisik dibawa saat hari H.</p>\r\n<p>\r\n	* Dress code :</p>\r\n<p>\r\n	&nbsp;&nbsp; &bull; Pria : Baju putih polos, dasi hitam, celana panjang hitam, dan bersepatu hitam.</p>\r\n<p>\r\n	&nbsp;&nbsp; &bull; Wanita : Baju putih (berkerah dan berlengan), rok hitam minimal selutut dan bersepatu hitam (jilbab hitam)</p>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n<p>\r\n	* Peserta dilarang menggunakan kendaraan pribadi ke tempat acara</p>\r\n<p>\r\n	* Peserta wajib menggunakan masker, face shield, dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	Syarat dan ketentuan mengikuti ALB dan Magang Bersama Periode November 2020 Pengwil Jateng INI :</p>\r\n<p>\r\n	1. Calon Peserta wajib mendaftarkan secara online dan mengisi link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal 12 Februari 2021. Pukul 23.59 WIB</p>\r\n<p>\r\n	2. Calon Peserta tersebut dalam angka 1, yang mengisi link lebih dari 12 Februari 2021 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode Februari baru dapat mengikuti periode Februari.</p>\r\n<p>\r\n	3. Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu. Apabila masih ada kuota, dapat mengikuti kegiatan bulan Februari. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n<p>\r\n	4. Pelaksanaan ALB dan Magber periode November akan dibagi dalam kelas-kelas yang akan diumumkan maksimal 13 Februari 2021.</p>\r\n<p>\r\n	5. Calon peserta wajib membawa bukti Rapid Antigen maksimal H-2 dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia.</p>\r\n<p>\r\n	6. Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37,5 derajat celcius atau sedang flu/batuk, panitia berhak untuk mengundur pelaksanaan peserta tersebut untuk ikut pada pelaksanaan periode berikutnya dan uang yang telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n<p>\r\n	7. Semua data yang diupload harus dari berkas asli atau apabila fotocopy harus ada legalisir instansi yang berwenang dan jelas terbaca. Data yang diupload harus berupa scan tidak diperkenankan dari foto kamera. Hal-hal yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ttd Panitia</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Pelaksana</p>\r\n','2021-04-15 11:48:08','0000-00-00 00:00:00'),(6,'Seleksi Anggota Luar Biasa Pengurus wilayah Jawa Tengah INI periode Mei 2021','no','','2021-05-20','<p>\r\n	Seleksi Anggota Luar Biasa Pengurus wilayah Jawa Tengah INI periode Mei 2021 akan dilaksanakan pada tanggal 27&nbsp; Mei 2021 di Hotel Grasia Semarang</p>\r\n<p>\r\n	Penting harap menjadi perhatian setiap peserta</p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n<p>\r\n	* Data fisik dibawa saat hari&nbsp; Pelaksanaan .</p>\r\n<p>\r\n	* Dress code :</p>\r\n<p>\r\n	&nbsp;&nbsp; &bull; Pria : Baju putih polos, dasi hitam, celana panjang hitam, dan bersepatu hitam.</p>\r\n<p>\r\n	&nbsp;&nbsp; &bull; Wanita : Baju putih (berkerah dan berlengan), rok hitam minimal selutut dan bersepatu hitam jilbab hitam bagi yang berhijab.</p>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n<p>\r\n	* Peserta wajib menggunakan masker, face shield, dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	Syarat dan ketentuan mengikuti Seleksi ALB&nbsp; Periode Mei 2021 Pengwil Jateng INI :</p>\r\n<p>\r\n	1. Calon Peserta wajib mendaftarkan secara online dan mengisi link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal&nbsp; 20&nbsp; Mei 2021. Pukul 23.59 WIB</p>\r\n<p>\r\n	2. Calon Peserta tersebut dalam angka 1, yang mengisi link lebih dari 20 Mei 2021 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode Mei baru dapat mengikuti periode Mei.</p>\r\n<p>\r\n	3. Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu. Apabila masih ada kuota, dapat mengikuti kegiatan bulan Februari. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n<p>\r\n	4. Pelaksanaan ALB dan Magber periode Mei 2021 akan dibagi dalam kelas-kelas yang akan diumumkan maksimal&nbsp; 24 Mei 2021.</p>\r\n<p>\r\n	5. Calon peserta wajib membawa bukti Rapid tes Antigen yang masih berlaku pada saat pelaksanaan dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia.</p>\r\n<p>\r\n	6. Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37,5 derajat celcius atau sedang flu/batuk, panitia berhak untuk mengundur pelaksanaan peserta tersebut untuk ikut pada pelaksanaan periode berikutnya dan uang yang telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n<p>\r\n	7. Semua data yang diupload harus dari berkas asli atau apabila fotocopy harus ada legalisir instansi yang berwenang dan jelas terbaca. Data yang diupload harus berupa scan tidak diperkenankan dari foto kamera. Hal-hal yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ttd Panitia</p>\r\n','2021-05-23 23:39:39','0000-00-00 00:00:00'),(7,'Seleksi Anggota Luar Biasa Pengwil Jateng INI periode Agustus 2021','yes','alb_2_.jpeg','2021-08-23','<p>\r\n	Seleksi Anggota Luar Biasa Pengurus wilayah Jawa Tengah INI periode AGUSTUS 2021 akan dilaksanakan pada tanggal 25 Agustus 2021 di The Sunan Hotel Solo</p>\r\n<p>\r\n	Penting harap menjadi perhatian setiap peserta</p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n<p>\r\n	* Data fisik dibawa saat hari&nbsp; Pelaksanaan .</p>\r\n<p>\r\n	* Dress code :</p>\r\n<p>\r\n	&nbsp;&nbsp; &bull; Pria : Baju putih polos, dasi hitam, celana panjang hitam, dan bersepatu hitam.</p>\r\n<p>\r\n	&nbsp;&nbsp; &bull; Wanita : Baju putih (berkerah dan berlengan), rok hitam minimal selutut dan bersepatu hitam jilbab hitam bagi yang berhijab.</p>\r\n<p>\r\n	* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n<p>\r\n	* Peserta wajib menggunakan masker, face shield, dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	Syarat dan ketentuan mengikuti Seleksi ALB&nbsp; Periode Agustus 2021 Pengwil Jateng INI :</p>\r\n<p>\r\n	1. Calon Peserta wajib mendaftarkan secara online dan mengisi link pindaftaran di www.inijateng.org, mengupload data dan membayar bia