INSERT INTO `arf_magang` VALUES (1,'Magang Bersama 22 Februari 2020',1,'no','WhatsApp Image 2020-01-02 at 17.38.19.jpeg','2020-02-20','<div class=\"pernyataan\">\r\n	<p>\r\n		<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n	<p>\r\n		* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.<br />\r\n		* Kategori peserta :</p>\r\n	<ol>\r\n		<li>\r\n			Semester 1\r\n			<ul>\r\n				<li>\r\n					ALB yang telah magang di kantor notaris selama minimal 6 bulan sampai dengan Februari 2020 terhitung sejak mendaftar menjadi ALB di PP INI.</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 300.000,-</strong></li>\r\n			</ul>\r\n		</li>\r\n		<li>\r\n			Semester 2\r\n			<ul>\r\n				<li>\r\n					ALB yang telah mengikuti magang bersama semester 1, 6 bulan sebelum Februari 2020 (melampirkan surat keterangan magang bersama semester 1).</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 600.000,-</strong></li>\r\n			</ul>\r\n		</li>\r\n		<li>\r\n			Semester 3\r\n			<ul>\r\n				<li>\r\n					ALB yang telah mengikuti magang bersama semester 2, 6 bulan sebelum Februari 2020 (melampirkan surat keterangan magang bersama semester 1 dan 2).</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 600.000,-</strong></li>\r\n			</ul>\r\n		</li>\r\n		<li>\r\n			Semester 4\r\n			<ul>\r\n				<li>\r\n					ALB yang telah mengikuti magang bersama semester 3, 6 bulan sebelum Februari 2020 dan sekurang kurangnya 24 bulan setelah terdaftar menjadi ALB di PP INI (melampirkan surat keterangan magang bersama semester 1, 2 dan 3).</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 800.000,-</strong><br />\r\n					&nbsp;</li>\r\n			</ul>\r\n		</li>\r\n	</ol>\r\n	<p>\r\n		* Data fisik dibawa saat hari H.<br />\r\n		* Dress code</p>\r\n	<ul>\r\n		<li>\r\n			Pria : Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu.</li>\r\n		<li>\r\n			Wanita : Baju putih (berkerah dan berlengan) rok hitam minimal selutut dan bersepatu (jilbab hitam)</li>\r\n	</ul>\r\n	<p>\r\n		* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n</div>\r\n','2020-03-20 09:55:24','0000-00-00 00:00:00'),(2,'Magang Bersama periode Mei 2020 Pengwil Jateng INI  Tgl 6 Mei 2020',0,'no','WhatsApp Image 2020-02-29 at 18.39.58.jpeg','2020-03-19','<p style=\"text-align: justify;\">\r\n	Magang Bersama periode Mei 2020 Pengwil Jateng INI Tgl 6 Mei 2020 di R. Poncowati hotel Patra Semarang</p>\r\n<div class=\"pernyataan\">\r\n	<p>\r\n		<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n	<p>\r\n		* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.<br />\r\n		* Kategori peserta :</p>\r\n	<ol>\r\n		<li>\r\n			Semester 1\r\n			<ul>\r\n				<li>\r\n					ALB yang telah magang di kantor notaris selama minimal 6 bulan sampai dengan Mei 2020 terhitung sejak mendaftar menjadi ALB di PP INI.</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 300.000,-</strong></li>\r\n			</ul>\r\n		</li>\r\n		<li>\r\n			Semester 2\r\n			<ul>\r\n				<li>\r\n					ALB yang telah mengikuti magang bersama semester 1, 6 bulan sebelum Mei 2020 (melampirkan surat keterangan magang bersama semester 1).</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 600.000,-</strong></li>\r\n			</ul>\r\n		</li>\r\n		<li>\r\n			Semester 3\r\n			<ul>\r\n				<li>\r\n					ALB yang telah mengikuti magang bersama semester 2, 6 bulan sebelum Mei 2020 (melampirkan surat keterangan magang bersama semester 1 dan 2).</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 600.000,-</strong></li>\r\n			</ul>\r\n		</li>\r\n		<li>\r\n			Semester 4\r\n			<ul>\r\n				<li>\r\n					ALB yang telah mengikuti magang bersama semester 3, 6 bulan sebelum Mei 2020 (melampirkan surat keterangan magang bersama semester 1, 2 dan 3).</li>\r\n				<li>\r\n					Kontribusi <strong>Rp. 800.000,-</strong><br />\r\n					&nbsp;</li>\r\n			</ul>\r\n		</li>\r\n	</ol>\r\n	<p>\r\n		* Data fisik dibawa saat hari H.<br />\r\n		* Dress code</p>\r\n	<ul>\r\n		<li>\r\n			Pria : Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu.</li>\r\n		<li>\r\n			Wanita : Baju putih (berkerah dan berlengan) rok hitam minimal selutut dan bersepatu (jilbab hitam)</li>\r\n	</ul>\r\n	<p>\r\n		* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n</div>\r\n','2020-07-08 18:09:36','0000-00-00 00:00:00'),(5,'Magang Bersama Pengwil Jateng INI periode Agustus 2020',0,'no','MAGBER 2.jpg','2020-08-01','<p style=\"text-align: justify;\">\r\n	Magang Bersama periode Agustus 2020 Pengwil Jateng INI, perkiraan waktu akhir agustus 2020 di Resto Alam Indah Jl Setiabudi 12 Semarang</p>\r\n<div class=\"pernyataan\">\r\n	<p>\r\n		<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n	<p>\r\n		* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n	<p>\r\n		<strong>PERSYARATAN PENDAFTARAN</strong></p>\r\n	<p>\r\n		1.&nbsp;&nbsp; Mengisi form pendaftaran dengan PC/Laptop di website <a href=\"http://www.inijateng.org/\">www.inijateng.org</a></p>\r\n	<p>\r\n		2.&nbsp;&nbsp; Fotocopy KTP</p>\r\n	<p>\r\n		3.&nbsp;&nbsp; Fotocopy KTA Luar Biasa dari Pengurus Pusat yang dilegalisir notaris</p>\r\n	<p>\r\n		4.&nbsp;&nbsp; 3 (tiga) lembar pas foto ukuran 4x6 dengan latar belakang merah</p>\r\n	<p>\r\n		5.&nbsp;&nbsp; Fotocopy Surat Keterangan Magang dari Notaris penerima magang, yang diketahui pengda INI setempat</p>\r\n	<p>\r\n		6.&nbsp;&nbsp; Fotocopy Ijazah S1 (Hukum) yang dilegalisir perguruan tinggi setempat</p>\r\n	<p>\r\n		7.&nbsp;&nbsp; Fotocopy Ijazah S2 Magister Kenotariatan yang dilegalisir perguruan tinggi setempat</p>\r\n	<p>\r\n		8.&nbsp;&nbsp; Membayar biaya pendaftaran sesuai kategori.</p>\r\n	<p>\r\n		<strong>DRESS CODE</strong></p>\r\n	<p>\r\n		PRIA:</p>\r\n	<p>\r\n		Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu hitam.</p>\r\n	<p>\r\n		WANITA:</p>\r\n	<p>\r\n		Baju putih polos, rok hitam minimal selutut atau celana panjang, dan bersepatu hitam (jilbab hitam).</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&middot;&nbsp; &nbsp; &nbsp; Peserta dilarang membawa kendaraan sendiri</p>\r\n	<p>\r\n		&middot;&nbsp; &nbsp; &nbsp; Harap memakai masker, face shield dan membawa hand sanitizer sendiri</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Panitia berhak mendiskualifikasi peserta dengan dresscode yang tidak sesuai serta memperhatikan protokol Covid 19</p>\r\n	<p style=\"margin-left:18.0pt;\">\r\n		&nbsp;</p>\r\n	<p>\r\n		<strong>KATEGORI PESERTA</strong></p>\r\n	<p style=\"margin-left:18.0pt;\">\r\n		<strong>Semester 1</strong></p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah magang di Kantor Notaris selama minimal 6 bulan sampai dengan Agustus 2020 terhitung sejak tanggal surat ALB yang dikeluarkan</p>\r\n	<p>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; oleh PP INI</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.300.000,-</p>\r\n	<p style=\"margin-left:14.2pt;\">\r\n		Semester 2</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah mengikuti magang bersama semester 1 dan telah magang di kantor Notaris selama minimal 12 bulan sampai dengan&nbsp;</p>\r\n	<p>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Agustus 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang Bersama Semester 1</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.600.000,-</p>\r\n	<p style=\"margin-left:14.2pt;\">\r\n		<strong>Semester 3</strong></p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah mengikuti magang bersama semester 2 dan telah magang di kantor Notaris selama minimal 18 bulan sampai dengan&nbsp;</p>\r\n	<p>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Agustus 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang Bersama Semester 1 dan Semester 2</p>\r\n	<p>\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.600.000,-</p>\r\n	<p style=\"margin-left:14.2pt;\">\r\n		<strong>Semester 4</strong></p>\r\n	<p style=\"margin-left:14.2pt;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &middot;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ALB yang telah mengikuti magang bersama semester 3 dan telah magang di kantor Notaris selama minimal 24 bulan sampai dengan&nbsp;&nbsp;</p>\r\n	<p style=\"margin-left:35.45pt;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Agustus 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n	<p style=\"margin-left:35.45pt;\">\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n	<p style=\"margin-left:35.45pt;\">\r\n		&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang Bersama Semester 1, Semester 2 dan Semester 3</p>\r\n	<p>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; .&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Kontribusi Rp.600.000,-* Panitia berhak mendiskualifikasi peserta dengan dresscode tidak sesuai.</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		<strong>Syarat dan ketentuan</strong> mengikuti ALB dan Magang Bersama Periode Agustus 2020 Pengwil Jateng INI :</p>\r\n	<p>\r\n		1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon Peserta yang namanya tercantum dalam daftar dibawah ini wajib mengisi&nbsp; link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal &nbsp;31 Juli 2020. Pukul 24.00 WIB</p>\r\n	<p>\r\n		2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon Peserta tersebut dalam angka 1,&nbsp; yang mengisi link lebih dari 31 Juli 2020 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode Agustus baru dapat mengikuti periode Agustus.</p>\r\n	<p>\r\n		3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu.</p>\r\n	<p>\r\n		Apabila masih ada kuota, dapat mengikuti kegiatan bulan Agustus. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu&nbsp; periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n	<p>\r\n		4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan ALB dan Magber periode Agustus akan dibagi dalam kelas-kelas &nbsp;yang akan diumumkan&nbsp; maksimal &nbsp;10 Agustus 2020.</p>\r\n	<p>\r\n		5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Calon peserta yang berasal dari luar Jawa Tengah (sesuai KTP) wajib membawa bukti Rapid Test maksimal &nbsp;H-2 dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia. Peserta dr luar Jawa Tengah yang telah berdomisili di Jawa Tengah dapat dibuktikan dengan telah mengikuti magang di kantor Notaris yang berada di Jawa Tengah sejak minimal 6 bulan yang lalu</p>\r\n	<p>\r\n		6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peserta dilarang membawa kendaraan sendiri.</p>\r\n	<p>\r\n		7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan&nbsp; ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37 atau sedang flu/batuk, panitia berhak utk mengundur pelaksanaan peserta tersebut utk ikut pada pelaksanaan periode berikutnya dan uang yg telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n	<div>\r\n		8. Semua data yang diupload harus dari berkas asli atau apabila fotocopy hrs ada legalisir notaris dan jelas terbaca. Data yang diupload hrs berupa scan tidak diperkenankan dari foto kamera.</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<p>\r\n		Hal-hal &nbsp;yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		Ttd</p>\r\n	<p>\r\n		Panitia Pelaksana</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		<strong>Daftar Nama Peserta Magang&nbsp;</strong></p>\r\n	<p>\r\n		<strong>Semester 1</strong></p>\r\n	<p>\r\n		1.&nbsp;&nbsp;&nbsp;&nbsp; A Yoma Amanda Putri</p>\r\n	<p>\r\n		2.&nbsp;&nbsp;&nbsp;&nbsp; Ahmad Yahya</p>\r\n	<p>\r\n		3.&nbsp;&nbsp;&nbsp;&nbsp; Antonia Irawan</p>\r\n	<p>\r\n		4.&nbsp;&nbsp;&nbsp;&nbsp; Aria Wirabhuana</p>\r\n	<p>\r\n		5.&nbsp;&nbsp;&nbsp;&nbsp; Arif Raharjo., SH., MKn.&nbsp;</p>\r\n	<p>\r\n		6.&nbsp;&nbsp;&nbsp;&nbsp; Arif Tedjo Asmoro, SH, MH, MKn</p>\r\n	<p>\r\n		7.&nbsp;&nbsp;&nbsp;&nbsp; Arina Wijayanti</p>\r\n	<p>\r\n		8.&nbsp;&nbsp;&nbsp;&nbsp; ARIZAL ZULFIKAR S.H., M.Kn.&nbsp;</p>\r\n	<p>\r\n		9.&nbsp;&nbsp;&nbsp;&nbsp; Bagus Yogo Jendro Baskoro&nbsp;</p>\r\n	<p>\r\n		10.&nbsp;&nbsp; Bayun Kismantoro</p>\r\n	<p>\r\n		11.&nbsp;&nbsp; Beta Riesca Lotusia Hidayat&nbsp;</p>\r\n	<p>\r\n		12.&nbsp;&nbsp; Bunga Desyana Pratama&nbsp;</p>\r\n	<p>\r\n		13.&nbsp;&nbsp; Danang Catur Wahyu W</p>\r\n	<p>\r\n		14.&nbsp;&nbsp; Delia</p>\r\n	<p>\r\n		15.&nbsp;&nbsp; Demitha Marsha</p>\r\n	<p>\r\n		16.&nbsp;&nbsp; DENNI SAPUTRA, S.H.,M.Kn&nbsp;</p>\r\n	<p>\r\n		17.&nbsp;&nbsp; Dhennia Audri herlandina&nbsp; &nbsp; &nbsp;</p>\r\n	<p>\r\n		18.&nbsp;&nbsp; Dian Ayu Istyaningrum</p>\r\n	<p>\r\n		19.&nbsp;&nbsp; Diannuri Ayuningt