AMEAN SITUMORANG,S.H.,M.Kn.</p>\r\n	<p>\r\n		18.&nbsp;&nbsp; Rachmadani Eka Husnul Khotimah</p>\r\n	<p>\r\n		19.&nbsp;&nbsp; Retno Puspo Dewi</p>\r\n	<p>\r\n		20.&nbsp;&nbsp; SUMINI,SH,M.Kn</p>\r\n	<p>\r\n		21.&nbsp;&nbsp; Supriyadi,</p>\r\n	<p>\r\n		22.&nbsp;&nbsp; Tegar Octora Yolandhi, SH., M.Kn</p>\r\n	<p>\r\n		23.&nbsp;&nbsp; Triyanto Setyo Nugroho,</p>\r\n	<p>\r\n		24.&nbsp; &nbsp;Veri Rianto silitonga</p>\r\n</div>\r\n','2020-10-16 16:44:31','0000-00-00 00:00:00'),(6,'Magang Bersama Pengwil Jateng INI periode November 2020',0,'no','','2020-11-11','<p>\r\n	Magang Bersama periode November 2020 Pengwil Jateng INI, diselenggarakan pada tanggal 16-17 November 2020 di Resto Alam Indah Jl Setiabudi 12 Semarang</p>\r\n<p>\r\n	<strong>Penting harap menjadi perhatian setiap peserta</strong></p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n<p>\r\n	<strong>PERSYARATAN PENDAFTARAN</strong></p>\r\n<p>\r\n	1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mengisi form pendaftaran dengan PC/Laptop di website&nbsp;<a href=\"http://www.inijateng.org/\">www.inijateng.org</a></p>\r\n<p>\r\n	2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fotocopy KTP</p>\r\n<p>\r\n	3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fotocopy KTA Luar Biasa dari Pengurus Pusat yang dilegalisir notaris</p>\r\n<p>\r\n	4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3 (tiga) lembar pas foto ukuran 4x6 dengan latar belakang merah</p>\r\n<p>\r\n	5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fotocopy Surat Keterangan Magang dari Notaris penerima magang, yang diketahui pengda INI setempat</p>\r\n<p>\r\n	6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fotocopy Ijazah S1 (Hukum) yang dilegalisir perguruan tinggi setempat</p>\r\n<p>\r\n	7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fotocopy Ijazah S2 Magister Kenotariatan yang dilegalisir perguruan tinggi setempat</p>\r\n<p>\r\n	8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Membayar biaya pendaftaran sesuai kategori.</p>\r\n<p>\r\n	9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Semua Persyaratan yang di upload, di scan dari aslinya</p>\r\n<p>\r\n	<strong>DRESS CODE</strong></p>\r\n<p>\r\n	PRIA:</p>\r\n<p>\r\n	Baju putih lengan panjang, dasi hitam, celana panjang hitam, dan bersepatu hitam.</p>\r\n<p>\r\n	WANITA:</p>\r\n<p>\r\n	Baju putih polos, rok hitam minimal selutut atau celana panjang, dan bersepatu hitam (jilbab hitam).</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&middot;&nbsp; &nbsp; &nbsp; Peserta dilarang membawa kendaraan sendiri</p>\r\n<p>\r\n	&middot;&nbsp; &nbsp; &nbsp; Harap memakai masker, face shield dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Panitia berhak mendiskualifikasi peserta dengan dresscode yang tidak sesuai serta memperhatikan protokol Covid 19</p>\r\n<p style=\"margin-left:18.0pt;\">\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>KATEGORI PESERTA</strong></p>\r\n<p style=\"margin-left:18.0pt;\">\r\n	<strong>Semester 1</strong></p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah magang di Kantor Notaris selama minimal 6 bulan sampai dengan November 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.300.000,-</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	<strong>Semester 2</strong></p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah mengikuti magang bersama semester 1 dan telah magang di kantor Notaris selama minimal 12 bulan sampai dengan&nbsp;</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; November 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang Bersama Semester 1</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.600.000,-</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	<strong>Semester 3</strong></p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah mengikuti magang bersama semester 2 dan telah magang di kantor Notaris selama minimal 18 bulan sampai dengan&nbsp;</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; November 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang Bersama Semester 1 dan Semester 2</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.600.000,-</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	<strong>Semester 4</strong></p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ALB yang telah mengikuti magang bersama semester 3 dan telah magang di kantor Notaris selama minimal 24 bulan sampai dengan&nbsp;&nbsp;</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; November 2020 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Keterangan Magang Bersama Semester 1, Semester 2 dan Semester 3</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kontribusi Rp.600.000,-</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Syarat dan ketentuan</strong>&nbsp;mengikuti ALB dan Magang Bersama Periode November 2020 Pengwil Jateng INI :</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	1.&nbsp;&nbsp;&nbsp; Calon Peserta yang namanya tercantum dalam daftar dibawah ini wajib mengisi&nbsp; link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal&nbsp; 10 November 2020. Pukul 23.59 WIB</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	2.&nbsp;&nbsp;&nbsp; Calon Peserta tersebut dalam angka 1,&nbsp; yang mengisi link lebih dari 10 November 2020 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode November baru dapat mengikuti periode November.</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	3.&nbsp;&nbsp;&nbsp; Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu.</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	4.&nbsp;&nbsp;&nbsp; Apabila masih ada kuota, dapat mengikuti kegiatan bulan November. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu&nbsp; periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	5.&nbsp;&nbsp;&nbsp; Pelaksanaan ALB dan Magber periode November akan dibagi dalam kelas-kelas &nbsp;yang akan diumumkan&nbsp; maksimal&nbsp; 13 November 2020.</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	6.&nbsp;&nbsp;&nbsp; Calon peserta yang berasal dari luar Jawa Tengah (sesuai KTP) wajib membawa bukti Rapid Test maksimal &nbsp;H-2 dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia. Peserta dr luar Jawa Tengah yang telah berdomisili di Jawa Tengah dapat dibuktikan dengan telah mengikuti magang di kantor Notaris yang berada di Jawa Tengah sejak minimal 6 bulan yang lalu</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	7.&nbsp;&nbsp;&nbsp; Peserta dilarang membawa kendaraan sendiri.</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	8.&nbsp;&nbsp;&nbsp; Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan&nbsp; ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37 atau sedang flu/batuk, panitia berhak utk mengundur pelaksanaan peserta tersebut utk ikut pada pelaksanaan periode berikutnya dan uang yg telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n<p style=\"margin-left:14.2pt;\">\r\n	9.&nbsp;&nbsp;&nbsp; Semua data yang diupload harus dari berkas asli atau apabila fotocopy hrs ada legalisir notaris dan jelas terbaca. Data yang diupload hrs berupa scan tidak diperkenankan dari foto kamera.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Hal-hal &nbsp;yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ttd</p>\r\n<p>\r\n	Panitia Pelaksana</p>\r\n','2021-01-18 10:43:50','0000-00-00 00:00:00'),(7,'Magang Bersama Pengwil Jateng INI periode Februari 2021',0,'no','magber februari.png','2021-02-13','<p>\r\n	Magang Bersama periode Februari 2021 Pengwil Jateng INI, diselenggarakan pada tanggal 16-17-18 Februari 2021 di The Sunan Hotel Solo</p>\r\n<p>\r\n	Penting harap menjadi perhatian setiap peserta</p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n<p>\r\n	PERSYARATAN PENDAFTARAN</p>\r\n<p>\r\n	1. Mengisi form pendaftaran dengan PC/Laptop di website www.inijateng.org</p>\r\n<p>\r\n	2. Tanda daftar ALB (printout dari web PP INI)</p>\r\n<p>\r\n	3. KTP</p>\r\n<p>\r\n	4. Fotocopy Ijazah S1 (Hukum) yang dilegalisir perguruan tinggi setempat</p>\r\n<p>\r\n	5. Fotocopy Ijazah S2 Magister Kenotariatan yang dilegalisir perguruan tinggi setempat</p>\r\n<p>\r\n	6. Surat keterangan magang dari Notaris tempat magang (sesuai lamp. 3 peraturan perkumpulan ikatan notaris indonesia nomor: 19/PERKUMPULAN/INI/2019)</p>\r\n<p>\r\n	7. 3 (tiga) lembar Pas Foto ukuran 4x6 dengan latar belakang merah</p>\r\n<p>\r\n	8. Bukti transfer dengan menuliskan nama peserta (membayar biaya pendaftaran sesuai kategori)</p>\r\n<p>\r\n	9. Surat Tanda Telah Mengikuti Magang Bersama semester sebelumnya</p>\r\n<p>\r\n	10. Semua Persyaratan yang di upload, di scan dari aslinya</p>\r\n<p>\r\n	DRESS CODE</p>\r\n<p>\r\n	PRIA : Baju putih polos, dasi hitam, celana panjang hitam, dan bersepatu hitam.</p>\r\n<p>\r\n	WANITA : Baju putih polos, rok hitam minimal selutut atau celana panjang, dan bersepatu hitam (jilbab hitam).</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&middot; Harap memakai masker, face shield dan membawa hand sanitizer sendiri</p>\r\n<p>\r\n	&middot; Panitia berhak mendiskualifikasi peserta dengan dresscode yang tidak sesuai serta memperhatikan protokol Covid 19</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	KATEGORI PESERTA</p>\r\n<p>\r\n	Semester 1</p>\r\n<p>\r\n	&middot; ALB yang telah magang di Kantor Notaris selama minimal 6 bulan sampai dengan Februari 2021 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p>\r\n	&middot; Kontribusi Rp.300.000,-</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Semester 2</p>\r\n<p>\r\n	&middot; ALB yang telah mengikuti magang bersama semester 1 dan telah magang di kantor Notaris selama minimal 12 bulan sampai dengan Februari 2021 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang Bersama Semester 1</p>\r\n<p>\r\n	&middot; Kontribusi Rp.600.000,-</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Semester 3</p>\r\n<p>\r\n	&middot; ALB yang telah mengikuti magang bersama semester 2 dan telah magang di kantor Notaris selama minimal 18 bulan sampai dengan Februari 2021 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang Bersama Semester 1 dan Semester 2 &middot; Kontribusi Rp.600.000,-</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Semester 4</p>\r\n<p>\r\n	&middot; ALB yang telah mengikuti magang bersama semester 3 dan telah magang di kantor Notaris selama minimal 24 bulan sampai dengan Februari 2021 terhitung sejak tanggal surat ALB yang dikeluarkan oleh PP INI</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang dari Notaris penerima magang yang diketahui Pengda INI setempat</p>\r\n<p>\r\n	&middot; Surat Keterangan Magang Bersama Semester 1, Semester 2 dan Semester 3</p>\r\n<p>\r\n	&middot; Kontribusi Rp.600.000,-</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Syarat dan ketentuan mengikuti ALB dan Magang Bersama Periode Februari 2021 Pengwil Jateng INI :</p>\r\n<p>\r\n	1. Calon Peserta wajib mendaftarkan secara online dan mengisi link pindaftaran di www.inijateng.org, mengupload data dan membayar biaya sesuai ketentuan yang dipersyaratkan maksimal 12 Februari 2021. Pukul 23.59 WIB</p>\r\n<p>\r\n	2. Calon Peserta tersebut dalam angka 1, yang mengisi link lebih dari 12 Februari 2021 akan secara otomatis masuk ke daftar tunggu dan apabila masih ada kuota pelaksanaan periode Februari baru dapat mengikuti periode Februari.</p>\r\n<p>\r\n	3. Calon peserta yang namanya tidak tercantum dalam list tetapi mengisi link dan melakukan pembayaran akan masuk ke daftar tunggu. Apabila masih ada kuota, dapat mengikuti kegiatan bulan Februari. Bilamana kuota sudah penuh maka dimasukan ke daftar tunggu periode berikutnya.Pengembalian uang pendaftaran dilakukan minimal 1 bulan setelah pelaksanaan acara, dengan menunjukkan bukti transfer (asli) dan identitas diri.</p>\r\n<p>\r\n	4. Pelaksanaan ALB dan Magber periode November akan dibagi dalam kelas-kelas yang akan diumumkan maksimal 13 Februari 2021.</p>\r\n<p>\r\n	5. Calon peserta wajib membawa bukti Rapid Antigen maksimal H-2 dan datang lebih awal 1 jam dari acara utk diserahkan kepada panitia.</p>\r\n<p>\r\n	6. Peserta wajib mempergunakan pakaian dan sepatu seperti yang telah ditentukan, memakai masker dan faceshield juga membawa hand sanitizer sendiri. Panitia berhak mendiskualifikasi apabila peserta tdk memenuhi persyaratan dan ketentuan protokol kesehatan.Apabila ada peserta yang tdk memenuhi persyaratan kesehatan : suhu badan melebihi 37,5 derajat celcius atau sedang flu/batuk, panitia berhak untuk mengundur pelaksanaan peserta tersebut untuk ikut pada pelaksanaan periode berikutnya dan uang yang telah dibayarkan dipergunakan utk periode berikutnya.</p>\r\n<p>\r\n	7. Semua data yang diupload harus dari berkas asli atau apabila fotocopy harus ada legalisir instansi yang berwenang dan jelas terbaca. Data yang diupload harus berupa scan tidak diperkenankan dari foto kamera.. Hal-hal yang blm cukup diatur akan diinformasikan lebih lanjut dalam group-group yang telah disiapkan.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ttd</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Panitia Pelaksana</p>\r\n','2021-04-15 11:53:14','0000-00-00 00:00:00'),(8,'Magang Bersama Pengurus Wilayah Jawa Tengah INI Periode Mei 2021',0,'no','WhatsApp Image 2021-04-25 at 19.26.10 (1).jpeg','2021-05-21','<p>\r\n	Magang Bersama periode Mei 2021 Pengwil Jateng INI, diselenggarakan pada tanggal 27-28&nbsp; Mei 2021 di Hotel Grasia Semarang</p>\r\n<p>\r\n	Penting harap menjadi perhatian setiap peserta</p>\r\n<p>\r\n	* Diharap menggunakan komputer atau laptop dalam proses pendaftaran.</p>\r\n<p>\r\n	PERSYARATAN PENDAFTARAN</p>\r\n<p>\r\n	1. Mengisi form pendaftaran dengan PC/Laptop di website www.inijateng.org</p>\r\n<p>\r\n	2. Tanda daftar ALB (pri