  `isi` text NOT NULL,
  `url_http_in` text NOT NULL,
  `tgl_input` datetime NOT NULL,
  `tgl_edit` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;
