INSERT INTO `arf_mekanisme` VALUES (1,'Pembuatan KTP','yes','mekanisme berkas-01.jpg','<p>\r\n	Keterangan :</p>\r\n<ol>\r\n	<li>\r\n		Datanglah ke RT/ RW untuk mendapatkan surat pengantar pembuatan KTP.</li>\r\n	<li>\r\n		Bawa surat pengantar tersebut ke kantor lurah, serahkan ke petugas da nisi formulir permohonan pembuatan KTP, tanda-tangangi dan serahkan ke lurah.</li>\r\n	<li>\r\n		Lurah akan menandatangani surat permohonan tersebut dan menyerahkannya kembali.</li>\r\n	<li>\r\n		Bawa surat permohonan tersebut berserta foto kopi Kartu keluarga ke Kantor Camat, dan serahkan ke petugas. Pada dasarnya sampai disini proses pembuatn KTP baru telah selesai.</li>\r\n	<li>\r\n		Petugas kecamatan akan memverifikasi dan validasi data kependudukan kita, selanjutnya surat permohonan disampaikan ke camat untuk ditanda tangani dan akan diteruskan ke Dinas Pencatatan Sipil (dilakukan oleh petugas).</li>\r\n	<li>\r\n		Setelah semua proses diatas tugas kita hanya menunggu terbitnya KTP baru, biasanya KTP sementara (non elektronik) akan terbit dalam beberapa hari saja.</li>\r\n</ol>\r\n<p>\r\n	<strong>Syarat-syarat Permohonan Kartu Tanda Penduduk (KTP)</strong></p>\r\n<ol>\r\n	<li>\r\n		Fotokopi Kartu Keluarga (KK).</li>\r\n	<li>\r\n		Menyerahkan KTP lama bagi yang perpanjangan.</li>\r\n	<li>\r\n		Fotokopi akta kelahiran bagi yang baru akan memiliki KTP.</li>\r\n	<li>\r\n		Fotokopi Akta Nikah/Akta Perkawinan bagi yang belum berusia 17 tahun.</li>\r\n	<li>\r\n		Bukti KTP yang rusak bagi yang memohon penggantian KTP.</li>\r\n	<li>\r\n		Surat Keterangan Hilang da<strong>ri </strong>Kepolisian bagi yang hilang.</li>\r\n	<li>\r\n		Khusus Orang Asing Tinggal Tetap melampirkan juga fotokopi dokumen keimigrasian seperti Pasport, Izin Tinggal Tetap, Surat Keterangan Lapor Diri Dari Mabes Polri.</li>\r\n</ol>\r\n','mekanisme-1-Pembuatan.KTP.html','2016-09-29 09:04:38','2017-01-13 16:21:38'),(2,'Pembuatan Akte Kelahiran','yes','akte.jpg','<p>\r\n	<strong>Syarat-syarat Permohonan Akta Kelahiran :</strong></p>\r\n<ol>\r\n	<li>\r\n		Mengisi formulir permohonan pencatatan kelahiran bermaterai Rp.6000,-</li>\r\n	<li>\r\n		Surat Keterangan Kelahiran dari dokter, bidan dan atau yang menolong kelahiran ( Kalau tidak ada digantikan dengan surat pernyataan kelahiran dari orangtua diketahui Kepala Desa / Lurah )</li>\r\n	<li>\r\n		Fotokopi surat nikah / akta nikah dilegalisir KUA (muslim) / Catatan Sipil (Non Muslim)</li>\r\n	<li>\r\n		Fotokopi KTP Elektronik yang masih berlaku &amp; KK orangtua</li>\r\n	<li>\r\n		Surat Kuasa Bermaterai Rp. 6000,- apabila pencatatannya dikuasakanFotokopi KTP 2 orang saksi yang masih berlaku.</li>\r\n</ol>\r\n','mekanisme-2-Pembuatan.Akte.Kelahiran.html','2016-09-29 09:10:34','2017-01-13 16:22:02'),(3,'Pembuatan Surat Nikah','yes','suratnikah.jpg','<p>\r\n	Syarat :</p>\r\n<ol>\r\n	<li>\r\n		Surat Keterangan Untuk Menikah (Model N1)</li>\r\n	<li>\r\n		Surat Keterangan Asal-Usul (Model N2)</li>\r\n	<li>\r\n		Surat Persetujuan Calon Mempelai (Model N3)</li>\r\n	<li>\r\n		Surat Keterangan Orang Tua (Model N4)</li>\r\n	<li>\r\n		Surat Keterangan persetujuan orang tua (Model N5) bagi Catin yang berusia kurang dari usia21 tahun pada tanggal pernikahan</li>\r\n	<li>\r\n		Surat Keterangan Kematian Istri (Model N6) bagi Duda Mati</li>\r\n	<li>\r\n		Disertai berkas pendukung:</li>\r\n</ol>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Foto Copy Kartu Tanda Penduduk (KTP)</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Foto Copy Akta Kelahiran</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Foto Copy Kartu Keluarga</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Akta Kematian/Surat Keterangan Kematian bagi duda mati</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Akta Cerai Asli berikut salinan putusan/penetapan bagi duda cerai</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Surat Ijin Kawin dari Komandan/Atasan bagi Catin Anggota TNI/POLRI</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dispensasi dari Pengadilan Agama bagi Catin yang belum berusia 19 tahun.</p>\r\n<p style=\"margin-left:49.65pt;\">\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pas Photo Ukuran 2&times;3 Background Biru sebanyak 4 LembarRekomendasi nikah dari Kantor Urusan Agama kecamatan setempat bila catin berasal dari daerah lain.</p>\r\n','mekanisme-3-Pembuatan.Surat.Nikah.html','2016-09-29 09:13:16','2017-01-14 22:46:25');
