INSERT INTO `arf_news` VALUES (1,'NOMOR INDUK BERUSAHA (NIB) BERFUNGSI SEBAGAI SIUP, TDP, API DAN KEPABENANAN','image_750x_5b39f9d2cd811_1_.jpg','<p style=\"text-align: justify;\">\r\n	Indonesia ditetapkan sebagai negara nomor dua terbaik di dunia untuk berinvestasi (versi US News 2018), namun memiliki peringkat yang awalnya cukup rendah dalam kemudahan berinvestasi atau Ease of Doing Business (EoDB) di tahun 2017, yaitu di peringkat 91 di dunia. Setelah melakukan berbagai pemangkasan jenis perijinan dan jangka waktu proses perijinan, World Bank kembali merilis dan mengumumkan bahwa Indonesia di tahun 2018 telah berhasil melejit 19 peringkat, yaitu ke peringkat 72 di dunia.</p>\r\n<div class=\"post-text\">\r\n	<p style=\"text-align: justify;\">\r\n		Namun, peringkat ke 72 di dunia dalam EoDB tersebut tidak membuat pemerintah Indonesia merasa cukup puas, karena potensi Indonesia yang sangat besar sebagai nomor 2 terbaik untuk destinasi investasi di dunia ini masih bisa di tingkatkan kembali jika EoDB nya juga meningkat tajam. Oleh karena itu, pemerintah menerbitkan Perpres RI No. 91 tahun 2017 tentang Percepatan Pelaksanaan Berusaha. Pertimbangan terbitnya Perpres ini karena perkembangan jumlah, penyebaran, skala, maupun efisiensi kegiatan usaha merupakan penentu utama dalam pertumbuhan ekonomi, penciptaan lapangan kerja, pengurangan kemiskinan serta ketimpangan antar daerah maupun antar kelompok pendapatan.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Percepatan pelaksanaan berusaha di dalam Perpres ini secara umum akan dilakukan melalui:</p>\r\n	<p style=\"text-align: justify;\">\r\n		Pembentukan satuan tugas (satgas) di Kementrian atau Lembaga, Pemerintahan Daerah Provinsi dan Kabupaten atau Kota yang bertugas mengawal pelaksanaan investasi atau kegiatan usaha dan membantu penyelesaian perizinan yang diperlukan oleh pelaku usaha.<br />\r\n		Memperbolehkan Investor atau pelaku usaha yang akan melakukan kegiatan di Kawasan Ekonomi Khusus, Kawasan Strategis Pariwisata, Kawasan industri dan Kawasan Perdagangan bebas dan Pelabuhan Bebas menunda perizinan tertentu.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Menggunakan data atau dokumen bersama dalam perizinan berusaha.<br />\r\n		Melakukan penyederhanaan regulasi dan mempermudah birokrasi perizinan berusaha.<br />\r\n		Menyatukan pengajuan perizinan, proses dan pengeluaran perizinan berusaha melalui sistem pengelolaan perizinan terpadu secara elektronik atau yang disebut dengan istilah Online Single Submission (OSS).<br />\r\n		<br />\r\n		Percepatan Pelaksanaan Berusaha dilakukan dalam 2 tahapan (pasal 2) Disebutkan dalam tahap pertama, pengawalan dan penyelesaian hambatan melalui pembentukan Satuan Tugas. Pelaksanaan Perizinan Berusaha dalam bentuk pemenuhan persyaratan (checklist) yang dilakukan di KEK, KPBPB, Kawasan Industri, dan KSPN. Pelaksanaan Perizinan Berusaha dengan menggunakan data sharing dan penyampaian yang tidak berulang yang dilakukan di luar KEK, KPBPB, Kawasan Industri, dan KSPN.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Selanjutnya di tahap Kedua, &nbsp;percepatan dalampelaksanaan reformasi peraturan Perizinan Berusaha dan &nbsp;penerapan Sistem Perizinan Berusaha Terintegrasi secara elektronik (Online Single Submission). Pelaksanaan kedua tahapan ini dapat dilakukan secara bersamaan. Dengan terbitnya Perpres &nbsp;ini jika ingin mengajukan izin berusaha sudah tidak diperlukan lagi belasan izin seperti SIUP, TDP, dan lain-lain. Semua terintegrasi dalam satu izin yaitu NIB (Nomor Induk Berusaha) yang pengurusannya akan selesai dalam 30 menit. Nomor Induk Berusaha (NIB) berfungsi juga sebagai Tanda Daftar Perusahaan (TDP), Angka Pengenal Importir (API), dan akses kepabeanan.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Terobosan DKI JAKARTA Melalui JakEVO</p>\r\n	<p style=\"text-align: justify;\">\r\n		Terkait dengan Perpres No. 91 tahun 2017, Pemprov DKI Jakarta baru-baru ini meluncurkan JakEVO, aplikasi smartphone untuk mengurus perizinan di DKI yang diharapkan bisa mendorong peringkat Ease of Doing Business (EoDB) Indonesia dari posisi ke 72 menjadi ke posisi 40 besar dunia.Dalam artikel megapolitan.kompas.com, Kepala Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu (DPMPTSP) Edy Junaedi menyampaikan, selain untuk perizinan, aplikasi ini bisa digunakan untuk mengurus Surat Izin Usaha Perdagangan (SIUP) dan Tanda Daftar Perusahaan (TDP). Menurutnya Pemrov DKI menyadari betul bahwa perkembangan ekonomi di Indonesia kian pesat dan semakin banyak usaha baru bermunculan. Kemajuan ini harus didukung dengan perizinan yang lebih baik sehingga para pelaku usaha dapat menyadari bahwa mengurus perijinan sendiri itu mudah.</p>\r\n	<p style=\"text-align: justify;\">\r\n		&nbsp;</p>\r\n	<p style=\"text-align: justify;\">\r\n		Bagaimana alur proses mengurus perizinan berusaha dengan menggunakan aplikasi JakEVO?</p>\r\n	<p style=\"text-align: justify;\">\r\n		Bapak Edy mengatakan, pengajuan izin dengan aplikasi ini lebih singkat karena hanya dengan tiga langkah. Tiga langkah itu yakni pengunggahan dokumen, tagging lokasi, serta disclaimer. Kemudian, dalam waktu 30 menit, pemohon sudah dapat menerbitkan SIUP dan TDP-nya sendiri</p>\r\n	<p style=\"text-align: justify;\">\r\n		Pada tahap awal pemohon harus mengunduh aplikasi JakEVO melalui Play Store atau dengan mengunjungi situs web jakevo.jakarta.go.id dan DPMPTSP Provinsi DKI Jakarta. Pemohon juga harus sudah mempersiapkan berkas yang akan diunggah sudah dalam bentuk Digital. Berkas &nbsp;apa saja yang harus diunggah tersebut terdapat dalam aplikasi JakEVO tersebut. Aplikasi JakEVO ini memungkinkan pemohon untuk mengunggah lebih dari satu berkas dalam waktu bersamaan. Berkas disimpan dalam folder &ldquo;berkas saya&rdquo; sehingga pemohon tidak perlu mengunggah ulang untuk izin yang selanjutnya ingin diajukan. Apabila pemohon tidak mengunggah berkas persyaratan sesuai ketentuan, pemohon akan diberi peringatan oleh petugas melalui fitur komentar.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Selanjutnya berkas yang telah diunggah oleh pemohon akan diverifikasi oleh petugas/ staff back office . Permohonan disetujui bila sudah memenuhi persyaratan yang ditetapkan. &nbsp;Tim surveyor akan melakukan survey lokasi usaha atau bangunan. Setelah lokasi usaha atau lokasi bangunan telah disurvey, pemohon diwajibkan membayar retribusi sebagaimana peraturan yang berlaku. Setelah pembayaran retribusi, proses selanjutnya adalah mendapatkan persetujuan kepala unit.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Umumnya, proses izin langsung menuju tahap penomoran. Namun, untuk izin-izin tertentu juga perlu persetujuan oleh kepala unit yang berada pada tingkat lebih tinggi. Tahap selanjutnya, setelah persetujuan kepala adalah penomoran SK Izin oleh staff TU. SK Izin akan dikirimkan ke akun pemohon, dan diinput oleh pengolah data. &nbsp;Jika perizinan SIUP dan TDP telah selesai diproses, pemohon akan mendapatkan notifikasi via email dan arahan untuk mengunduh sertifikat SIUP dan TDP secara online tanpa harus meminta tanda tangan basah. Pemohon tidak perlu mendatangi service point berkat teknologi digital signature olehpejabat yang berwenang.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Bagaimana untuk pelaku usaha yang sudah memiliki izin lama?</p>\r\n	<p style=\"text-align: justify;\">\r\n		Pelaku usaha dapat menunggu sampai salah satu izin (SIUP/TDP) habis, selanjutnya dapat mengajukan Nomor IndukBerusaha (NIB) secara online.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Tentunya dengan adanya Sistem Perizinan Berusaha Terintegrasi Secara Elektronik (Online Single Submission) melalui aplikasi JakEVO ini diharapkan akan mempermudah para pelaku usaha dalam mengurus perizinan berusaha.</p>\r\n	<p style=\"text-align: justify;\">\r\n		Referensi hukum</p>\r\n	<p style=\"text-align: justify;\">\r\n		Perpres RI No. 91 tahun 2017 tentang Percepatan Pelaksanaan Berusaha</p>\r\n	<p style=\"text-align: justify;\">\r\n		&nbsp;</p>\r\n	<p style=\"text-align: justify;\">\r\n		Referensi Online</p>\r\n	<p style=\"text-align: justify;\">\r\n		megapolitan.kompas.com</p>\r\n	<p style=\"text-align: justify;\">\r\n		oss.ekon.go.id<br />\r\n		irmadevita.com</p>\r\n</div>\r\n','yes','Rabu 11 Desember 2019','2019-12-11 19:16:02','0000-00-00 00:00:00',261),(2,'Menkumham Mengajak Jaga Kehormatan Notaris','Menkumham_Mengajak_Jaga_Kehormatan_Notaris_JPG_750x_5c8b102a010be.jpg','<p style=\"text-align: justify;\">\r\n	Bali - Menteri Hukum dan Hak Asasi Manusia (Menkumham) Yasonna H. Laoly kembali mengambil sumpah 26 Pejabat Pergantian Antar Waktu (PAW) Majelis Pengawas Wilayah Notaris (MPWN) dan Majelis Kehormatan Notaris Wilayah (MKNW), sekaligus pesertaForum Group Discussion &ldquo;Pengawasan Tingkat Kepatuhan Notaris&rdquo;, kegiatan ini sudah dilakukan sebelumnya di Medan kali ini diadakan di Hotel Discovery Kartika Plaza, Bali.(14/03)</p>\r\n<p style=\"text-align: justify;\">\r\n	Dalam sambutannya Yasonna menyayangkan masih ada notaris yang belum memahami kewenangannya, mematuhi kewajiban dan larangan jabatan yang diatur dalam Undang-Undang Jabatan Notaris serta peraturan perundang-undangan lainnya, berdasarkan Undang-Undang Jabatan Notaris, &ldquo;Saya banyak mendengar banyak pengaduan dari masyarakat notaris menyimpang dari peraturan, ini sangat disayangkan&rdquo; Jelasnya. &ldquo;Kadang notaris membuat persoalan semakin rumit, tanpa mempedulikan stakeholders kerugiannya seperti apa&rdquo; Lanjutnya. Yasonna telah memerintahkan Direktur Jenderal Administrasi Hukum Umum untuk membuat tim agar dapat mengurangi permasalahan pada notaris, karena persaingan yang sangat ketat. &ldquo;tindak tegas notaris yang melanggar hukum, blokir aksesnya di AHU Online sampai notaris itu memperbaiki kesalahannya&rdquo; Tegas pria usia 66 tahun ini.</p>\r\n<p style=\"text-align: justify;\">\r\n	Disisi lain, pelaksanaan jabatan notaris tidak terlepas dari peran masyarakat untuk mengawasi dan senantiasa melaporkan tindakan notaris apabila dalam melaksanakan tugas dan jabatannya tidak sesuai dengan aturan hukum yang berlaku Dengan didakan pelantikan ini, Yasonna Menginginkan seluruh PAW MPN dan MKN merubah semua perilaku yang menyimpang, melayani masyarakat dengan baik dan cepat untuk melakukan tugasnya dengan baik dan profesional. &ldquo;Saya ingin kita menjaga kehormatan notaris, agar tidak ada lagi keluhan masyarakat terhadap notaris yang melanggar peraturan&rdquo; Harapnya. &ldquo;Notaris perlu kita beri pembinaan dan pengawasan oleh Majelis Pengawas Notaris dan Majelis Kehormatan Notaris. Masing-masing lembaga ini mempunyai tugas dan fungsi yang berbeda&rdquo; Tutupnya.</p>\r\n<p style=\"text-align: justify;\">\r\n	Pelantikan Pergantian Antar Waktu Majelis Pengawas Wilayah dan Majelis Kehormatan Notaris Wilayah, sekaligus dilanjutkan dengan acara Forum Group Discussion &ldquo;Pengawasan Tingkat Kepatuhan Notaris&rdquo; dihadiri 110 Peserta yang terdiri dari unsur pejabat yang dilantik, Anggota Majelis Pengawas Pusat Notaris, Kepala Kantor Wilayah, Kepala Divisi Pelayanan Hukum dan HAM, akademisi.</p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	Referensi : Humas. 2019. Menkumham Mengajak Jaga Kehormatan Notaris di portal.ahu.go.id (diakses 15 Maret)</p>\r\n','yes','Rabu 11 Desember 2019','2019-12-11 19:18:25','0000-00-00 00:00:00',342),(3,'Pengawas Notaris Harus Tegas dan Profesional','pengawas-notaris-harus-tegas-dan-profesional_jpg_750x_5c85d5eaeda71.jpg','<p style=\"text-align: justify;\">\r\n	MEDAN - Menteri Hukum dan Hak Asasi Manusia (Menkumham) Yasonna H Laoly didampingi Sekertaris Jenderal (Sekjen) Kementerian Hukum dan Hak Asasi Manusia (Kemenkumham) Bambang Sariwanto melantik Pergantian Antar Waktu (PAW) Majelis Pengawas Notaris (MPN) dan Majelis Kehormatan Notaris (MKN).<br />\r\n	<br />\r\n	Yasonna mengatakan berdasarkan Undang-Undang Jabatan Notaris, Menteri mendelegasikan tugas pengawasan dan pembinaannya kepada MPN yang mempunyai kewenangan dan kewajiban untuk melaksanakan pembinaan dan pengawasan terhadap notaris dengan lingkup pengawasan meliputi perilaku dan pelaksanaan jabatan Notaris.<br />\r\n	<br />\r\n	Sementara, MKN memiliki kewenangan yang memberikan persetujuan atau penolakan terhadap kepentingan penyidikan dan proses peradilan, atas pengambilan fotokopi minuta akta dan pemanggilan notaris untuk hadir dalam pemeriksaan berkaitan dengan akta atau protokol notaris yang berada dalam penyimpanan Notaris.<br />\r\n	<br />\r\n	&quot;Masing-masing lembaga ini mempunyai tugas dan fungsi yang berbeda,&quot; kata Yasona, Jumat, (8/3/2019) di Hotel Four Points, Jalan Gatot Subroto, Kota Medan, Sumatera Utara.<br />\r\n	<br />\r\n	Pelaksanaan jabatan Notaris, kata dia, tidak terlepas dari peran masyarakat untuk mengawasi dan senantiasa melaporkan tindakan notaris apabila dalam melaksanakan tugas dan jabatannya tidak sesuai dengan aturan hukum yang berlaku.<br />\r\n	<br />\r\n	&quot;Khusus kepada MKN, dituntut untuk dapat bekerja secara cepat terhadap permohonan pihak penyidik, penuntut umum atau hakim, dan teliti dalam proses pemeriksaan terhadap Notaris sebelum surat persetujuan atau penolakan diberikan, sehingga penegakan dan perlindungan hukum terhadap Notaris dapat dilaksanakan sesuai peraturan perundang-undangan yang berlaku,&quot; ujarnya.<br />\r\n	<br />\r\n	Yasonna menjelaskan Kemenkumham seringkali digugat di Pengadilan Negeri (PN) maupun di Pengadilan Tata Usaha Negara (PTUN), baik digugat langsung maupun ditarik sebagai pihak karena&nbsp; berhubungan dengan terbitnya suatu akta Notaris, khususnya terkait dengan Perseroan Terbatas (PT) maupun badan hukum sosial yang pengesahan maupun perubahan anggaran dasarnya diproses di Kemenkumham melalui Direktorat Jenderal Administrasi Hukum Umum (Ditjen AHU).<br />\r\n	<br />\r\n	&quot;Akta yang dibuat Notaris terkait dengan gugatan tersebut pada dasarnya bermula dari kurang profesionalnya Notaris dalam melaksanakan jabatannya atau memang ada unsur kesengajaan yang dilakukan oleh Notaris karena adanya kepentingan tertentu,&quot; ungkapnya.<br />\r\n	<br />\r\n	Dia menuturkan pembinaan dan pengawasan terhadap notaris yang dilakukan secara lebih maksimal, terencana dan masif oleh MPN serta MKN dapat berkontribusi positif untuk mencegah atau mengurangi timbulnya gugatan.<br />\r\n	<br />\r\n	&quot;Tidak dapat dihindari dan merupakan bagian dari pelayanan terbaik kita kepada masyarakat, maka Majelis dituntut untuk dapat bekerja secara profesional, berintegritas, tidak memihak, senantiasa mengedepankan prinsip kepastian, ketertiban dan perlindungan hukum yang berintikan kebenaran dan keadilan,&quot; jelasnya.<br />\r\n	<br />\r\n	Lebih jauh, Yasonna berharap baik majelis bisa menindak tegas Notaris yang memang benar-benar melakukan pelanggaran perilaku dalam pelaksanaan jabatannya dan memberikan perlindungan hukum terhadap notaris yang memang benar-benar telah melaksanakan jabatannya sesuai dengan peraturan perundang-undangan.<br />\r\n	<br />\r\n	Pada pelantikan PAW MPN dan MKN ini, Yasonna melantik sebanyak 25 orang MPN dan MKN dari seluruh Indonesia. Mereka nantinya akan bertugas di berbagai daerah sebagaimana yang sudah ditunjuk dari Kemenkumham<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	Referensi :<br />\r\n	<br />\r\n	Humas. 2019. Pengawas Notaris Harus Tegas dan Profesional di portal.ahu.go.id (diakses 11 Maret)</p>\r\n','yes','Rabu 11 Desember 2019','2019-12-11 19:19:44','0000-00-00 00:00:00',326),(4,'Hasil Seleksi Anggota Luar Biasa Periode Februari 2020 Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia Semarang, 21 Februari 2020','Screenshot 2020-02-21 18.55.17.png','<p style=\"text-align: justify;\">\r\n	Hasil Seleksi Anggota Luar Biasa Periode Februari 2020 Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia Semarang, 21 Februari 2020</p>\r\n<p style=\"text-align: justify;\">\r\n	<a href=\"/foto_berita/files/Nilai.docx\">unduh disini</a></p>\r\n<p style=\"text-align: justify;\">\r\n	Untuk Surat Keterangan Lulus dapat diambil di Sekretariat Pengwil Jateng Ikatan Notaris Indonesia Tanggal 4 Maret 2020</p>\r\n','yes','Senin 2 Maret 2020','2020-03-02 09:37:45','0000-00-00 00:00:00',687),(5,'Buku AD, ART dan Peraturan Perkumpulan Ikatan Notaris Indonesia serta Buku Laporan Harian Kegiatan Magang','WhatsApp Image 2020-03-03 at 08.55.34_1_.jpeg','<p style=\"text-align: justify;\">\r\n	Buku AD, ART dan Peraturan Perkumpulan Ikatan Notaris Indonesia serta Buku Laporan Harian Kegiatan Magang dapat dibeli di <span>Soes Asmara Argawati, SH</span>.</p>\r\n<p style=\"text-align: justify;\">\r\n	Alamat : Ruko Sriwijaya,&nbsp; Jl. Sriwijaya No. 43 A Kavling D Semarang</p>\r\n<p style=\"text-align: justify;\">\r\n	<img alt=\"\" src=\"/foto_berita/images/WhatsApp Image 2020-03-03 at 08.55.54(1).jpeg\" style=\"width: 50%; height: 50%;\" /></p>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"400\" src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d15840.168594701423!2d110.4264988!3d-7.0043198!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x88a6b8e6b57f423b!2sSoes%20Asmara%20Argawati%2C%20SH!5e0!3m2!1sen!2sid!4v1583206237868!5m2!1sen!2sid\" style=\"border:0;\" width=\"98%\"></iframe></p>\r\n','yes','Selasa 3 Maret 2020','2020-03-03 10:31:40','0000-00-00 00:00:00',1685),(6,'Himbauan pencegahan penyebaran COVID 19','Screenshot 2020-03-20 09.45.18.png','<p style=\"text-align: justify;\">\r\n	Bapak/Ibu ALB yth. sehubungan dengan surat edaran tsb juga dari Gubernur Jawa Tengah pelaksanaan ALB Magber yg sedianya diadakan tgl 5-6 Mei 2020 ditunda utk waktu yang blm ditentukan. Bagi yg sudah mendaftar silakan mengirimkan no rek ke contact person masing2 utk pengembalian uang pendaftaran.<br />\r\n	Mohon maaf dan terimakasih<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<iframe height=\"500px\" src=\"/foto_berita/files/Pengwil%20Selindo%20-%20himbauan%20covid%20%2019.pdf\" width=\"100%\"></iframe></p>\r\n','yes','Jumat 20 Maret 2020','2020-03-20 09:52:21','0000-00-00 00:00:00',477),(7,'Penundaan Pelaksanaan Magang Bersama Periode Bulan Mei 2020','WhatsApp Image 2020-04-09 at 06.12.15.jpeg','','yes','Kamis 9 April 2020','2020-04-09 09:14:59','0000-00-00 00:00:00',852),(8,'Notaris Peduli Pengwil Jawa Tengah','screencapture-www-youtube-com-watch-1591158607062.png','<p>\r\n	#notaris peduli yang dilakukan oleh Pengurus Wilayah dan Pengurus Daerah Ikatan Notaris Indonesia Jawa Tengah.</p>\r\n<p>\r\n	<iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/eel8aolSenY\" width=\"100%\"></iframe></p>\r\n','yes','Rabu 3 Juni 2020','2020-06-03 11:31:16','0000-00-00 00:00:00',282),(9,'Selamat Idul Fitri 1441 H Pengwil Jawa Tengah Ikatan Notaris Indonesia','screencapture-www-youtube-com-watch-1591158956826.png','<p>\r\n	Selamat Idul Fitri 1441 H Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia.</p>\r\n<p>\r\n	<iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/JvDKQN3EjPE\" width=\"100%\"></iframe></p>\r\n','yes','Rabu 3 Juni 2020','2020-06-03 11:37:05','0000-00-00 00:00:00',330),(10,'Webinar Pengwil Jateng Ikatan Notaris Indonesia','WhatsApp Image 2020-06-10 at 16.41.36.jpeg','<p>\r\n	Registrasi di :&nbsp;<a href=\"http://bit.ly/daftarinijateng\">bit.ly/D</a><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSdKG8ERWiN3YuMB3Oo-0k3s5Ac9m-Hpe0D_9H_WF6LVKWbdjg/viewform\">AFTARINIJATENG</a></p>\r\n','yes','Rabu 10 Juni 2020','2020-06-10 17:00:00','0000-00-00 00:00:00',595),(11,'PENEGAKAN HUKUM & PERLINDUNGAN HUKUM DALAM MENJALANKAN TUGAS JABATAN PROFESI (STUDY COMPARATIVE LAW)','maxresdefault.jpg','<p>\r\n	<iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/aYa-KBs77ZE\" width=\"100%\"></iframe></p>\r\n','yes','Rabu 1 Juli 2020','2020-07-01 09:19:50','0000-00-00 00:00:00',464),(12,'Pengwil Jateng INI mengucapkan SELAMAT ULANG TAHUN IKATAN NOTARIS INDONESIA KE 112','sddefault.jpg','<div>\r\n	Pengwil Jateng INI mengucapkan</div>\r\n<div>\r\n	SELAMAT ULANG TAHUN</div>\r\n<div>\r\n	IKATAN NOTARIS INDONESIA KE 112</div>\r\n<div>\r\n	PF : 1 JULI 2020</div>\r\n<div>\r\n	Jayalah selalu</div>\r\n<div>\r\n	&nbsp;</div>\r\n<p>\r\n	<iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/kzynPjPK4Iw\" width=\"100%\"></iframe></p>\r\n','yes','Rabu 1 Juli 2020','2020-07-01 09:25:25','0000-00-00 00:00:00',569),(13,'Pengwil Jateng INI Gelar MOU Dengan Kantor Akuntan Publik Dr. Arnestesa Trinandha,SE,MM,Ak,CA,CPA','Menunjukkan-hasil-MOU.jpg','<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px; text-align: justify;\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">SEMARANG &ndash;&nbsp;</span>Tepat pada hari Kamis, tanggal 27 Agustus 2020 lalu bertempat di resto Alam Indah, Kawasan Gombel, Kota Semarang, Jawa Tengah dilakukan penandatanganan/ perjanjian kesepahaman atau Memory Of Understanding (MOU) antara Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia (Pengwil Jateng INI) dengan &nbsp;Kantor Akuntan Publik Dr. Arnestesa Trinandha,SE,MM,Ak, CA,CPA.</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; margin: 0px 0px 1em; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px;\">\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" class=\"wp-image-889 lazyloaded\" data-src=\"https://indonesiapublisher.com/wp-content/uploads/2020/08/foto-bersama-usai-MOU-300x178.jpg\" src=\"https://indonesiapublisher.com/wp-content/uploads/2020/08/foto-bersama-usai-MOU-300x178.jpg\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; opacity: 1; transition: opacity 400ms ease 0ms;\" /></span></span></p>\r\n	<figcaption style=\"box-sizing: border-box; margin-top: 0.5em; margin-bottom: 1em;\">\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\">foto bersama usai mengadakan MOU</em></span></span></span></p>\r\n	</figcaption></figure></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px; text-align: justify;\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Menurut Ketua Pengwil Jawa Tengah INI, Dr. Widhi Handoko,SH,SpN yang didampingi Sekretaris Pengwil Jateng INI, Dr. Catharina Mulyani Santoso,SH,MH dalam kesempatan perbincangannya dengan&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\">indonesiapublisher.com&nbsp;</em></span>disela-sela acara mengatakan, MOU tersebut dilakukan semata-mata guna transparansi keuangan Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia.</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; margin: 0px 0px 1em; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px;\">\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" class=\"wp-image-891 lazyloaded\" data-src=\"https://indonesiapublisher.com/wp-content/uploads/2020/08/Dr.-Arnestesa-TrinandhaSEMMAkCACPA-berjabattangan-dengan-Dr.-Widhi-HandokoSHSpN-usai-melakukan-MOU-300x178.jpg\" src=\"https://indonesiapublisher.com/wp-content/uploads/2020/08/Dr.-Arnestesa-TrinandhaSEMMAkCACPA-berjabattangan-dengan-Dr.-Widhi-HandokoSHSpN-usai-melakukan-MOU-300x178.jpg\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; opacity: 1; transition: opacity 400ms ease 0ms;\" /></span></span></p>\r\n	<figcaption style=\"box-sizing: border-box; margin-top: 0.5em; margin-bottom: 1em;\">\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\">Dr. Arnestesa Trinandha,SE,MM,Ak,CA,CPA berjabattangan dengan Dr. Widhi Handoko,SH,SpN Usai MOU</em></span></span></span></p>\r\n	</figcaption></figure></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px; text-align: justify;\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">&ldquo;Hal ini tentunya sesuai dengan visi dan misi Pengwil Jawa Tengah INI, sehingga kita akan selalu rapi dan terbuka dalam hal transparansi keuangan organisasi dalam hal ini Pengwil Jateng INI, jika tidak sekarang, lalu kapan lagi, jika tidak kita yang memulainya, lalu siapa lagi,&rdquo;ujar Widhi Handoko.</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; margin: 0px 0px 1em; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px;\">\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" class=\"wp-image-893 lazyloaded\" data-src=\"https://indonesiapublisher.com/wp-content/uploads/2020/08/Melakukan-peandatanganan-MOU-300x178.jpg\" src=\"https://indonesiapublisher.com/wp-content/uploads/2020/08/Melakukan-peandatanganan-MOU-300x178.jpg\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; opacity: 1; transition: opacity 400ms ease 0ms;\" /></span></span></p>\r\n	<figcaption style=\"box-sizing: border-box; margin-top: 0.5em; margin-bottom: 1em;\">\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\">melakukan penandatanganan MOU</em></span></span></span></p>\r\n	</figcaption></figure></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px; text-align: justify;\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Widhi juga menuturkan, jadi 4 bendahara Pengwil Jateng INI akan didampingi&nbsp; oleh akuntan public.</span></span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px; text-align: justify;\">\r\n	<span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Acara MOU tersebut juga dihadiri para penasehat Pengwil Jateng INI, para Wakil Ketua, para Sekretaris dan para bendahara Pengwil Jateng INI.</span></span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: rgb(50, 50, 51); font-family: Helvetica, Arial; font-size: 16px;\">\r\n	<span style=\"font-size:14px;\">sumber :&nbsp;<a href=\"https://indonesiapublisher.com/2020/08/31/pengwil-jateng-ini-gelar-mou-dengan-kantor-akuntan-publik-dr-arnestesa-trinandhasemmakcacpa/\" style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px;\">https://indonesiapublisher.com/2020/08/31/pengwil-jateng-ini-gelar-mou-dengan-kantor-akuntan-publik-dr-arnestesa-trinandhasemmakcacpa/</a></span></p>\r\n','yes','Senin 31 Agustus 2020','2020-08-31 10:40:20','0000-00-00 00:00:00',488),(14,'Hasil Seleksi Anggota Luar Biasa Periode Agustus 2020 Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia','SK-hasil-seleksi-ALB-pdf.jpg','<p style=\"text-align: justify;\">\r\n	Hasil Seleksi Anggota Luar Biasa Periode Agustus 2020 Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia Semarang</p>\r\n<p style=\"text-align: justify;\">\r\n	<a href=\"/foto_berita/files/SK%20hasil%20seleksi%20ALB.pdf\">unduh disini</a></p>\r\n','yes','Rabu 2 September 2020','2020-09-02 09:31:30','0000-00-00 00:00:00',454),(15,'PENGWIL JATENG INI MOU DENGAN POLDA JATENG','IMG_20200916_013305-750x406.jpg','<div style=\"text-align: justify;\">\r\n	(Semarang) Selasa, 15 September 2020, Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia (Pengwil Jateng INI) dengan Kepolisian Daerah Jawa Tengah (Polda Jateng) telah menandatangani Nota Kesepahaman Nomor : 1/MoUINIJATENG/IX/2020 &ndash; KESMA/15/HUK.8.1.1/IX/2020.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Ketua Pengwil Jateng INI, Dr. Widhi Handoko. SH.SpN kepada Notary Magz&nbsp; menegaskan bahwa tujuan nota kepahaman dengan Kapolda Jateng ini dimaksudkan dalam rangka pembinaan dan penegakan hukum sebagai upaya meningkatkan profesionalisme anggotanya. Adapun tujuan lainnya adalah untuk menyamakan persepsi sekaligus silaturahim seluruh Pengda INI Se Jawa Tengah dan juga jajaran Kapolres Se Jawa Tengah. untuk terwujudnya kerja sama dan sinergitas dalam rangka peningkatan profesionalisme dimaksud.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Dr. Widhi Handoko. SH.SpN kepada Notary Magz&nbsp; di lobi Hotel Patra jasa Ruang Rama Shinta, Kota Semarang. juga mengungkapkan bahwa&nbsp; nota kesepahaman yang ditandatangani pada Selasa (14/9) hari ini menindaklanjuuti MOU PP INI dengan Kepolisian Republik Indonesia pada&nbsp; Agustus 2018 silam. Di jelaskan Widhi, adapun ruang lingkup Nota kepahamam dimaksud&nbsp; meliputi, tukar menukar informasi, pembinaan dan penegakan hukum dan peningkatan profesionalisme dan integritass kapasitas sumber daya manusia.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Inpektur Jenderal polisi Drs. Ahmad Lutfi. SH. S.St. M.K selaku Kepala Kepolisian Daerah (Kapolda) Jawa Tengah juga berkomitmen mendukung upaya pembinaan dan penegakan hukum sebagai upaya meningkatkan profesionalisme jajaran kepolisian Jawa Tengah. Menurut Kapolda, hal ini merupakan hal baru Kepolisian melakukan nota kepahaman dengan Notaris. Karena menurut Kapolda kerjasama yang ditanda tangani kali ini dilakukan dengan pejabat Negara (Notaris) di mana di dalamnya ada upaya penegakan hukum.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	&ldquo;Tentunya MOU ini sangat tepat dilakukan, dan nota kepahaman ini akan ditindaklanjuti dengan menyusun pedoman kerja sama (PKS) sebagai pelaksanaan atas nota kepahaman ini serta menjadi satu kesatuan yang tak terpisahkan,&rdquo; jelasnya kepada awak media di ruang Rama Shinta usai memberikan sambutannya.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Prinsipnya, lanjut&nbsp; Kapolda,&nbsp; utamanya tidak mengurangi asas legalitas yang berkaitan dengan KUHPidana yang dilakukan oleh para penyidik. Selanjutnya, dalam hal menjalankan rule of law yang menjadi dasar dalam penyelidikan tentunya tanpa mengurangi para pihak dari pada pejabat umum dalam hal ini (notaris) yang telah melakukan tugas notariatnya dengan tidak mengurangi ataupun menganggu aspek hukum yang dilaksanakannya. Dan tentu saja hal ini memerlukan law inforceman yang jelas, jangan sampai penyidik tidak mampu mengungkap alat bukti.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Melalui MoU ini, Kapolda mengharapkan pertama, Polda bersama para kapolres Se Jawa Tengah bersama dengan Pengwil jateng INI dan Pengda INI di seluruh daerah di&nbsp; Jawa Tengah minimal mereka mengenal dulu &ldquo;Law Enforcement&rdquo; yang dilakukan penyidik kita dilapangan.&nbsp; Dan jangan sampai juga dalam hal ini Notaris sebagai pejabat negara tidak memahami Law Enforcement atau penegakan hukum yang menjadi tugas penyidik kepolisian.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	&ldquo;Bahkan mau tidak mau, untuk penyelidikan tertentu seperti kasus tanah dan lainnya Saya rasa Kapolres pasti mampu menyelesaikannya. karena memang dalam hal ini dibutuhkan kemampuan menejerial agar jangan sampai salah dalam hal menjabarkan pembuktian masalah sehingga tidak overlaping,&rdquo; tegas kapolda</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Para pihak lanjut kapolda bisa mengenal dulu, prinsip penegakan tidak hanya bersifat kaku tapi juga progresif atau bisa juga humanis. Sehingga antara kita dengan Ikatan Notaris terjadi simbiusis mutualisme tanpa mengurangi penegakan hukum manakala terjadi tindak pidana yang dilakukan Notaris.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Inpektur Jenderal polisi Drs. Ahmad Lutfi. SH. S.St. M.K selaku Kapolda Jawa Tengah selalu menjalankan protokol kesehatan dalam berbagai kesempatan termasuk saat dirinya saat tiba di Hotel Patra Jasa Semarang</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Diakui Kapolda, selama ini di Wilayah Jateng belum terjadi pelanggaran berat yang dilakukan Notaris Jateng, tapi paling tidak aspek hukum yang dilakukan oleh pejabat negara ini mesti di gali secara bersama &ldquo;Saya ambil contoh dalam hal aspek jual beli tanah dimana maslah warkah tanah itu bukan perkara gampang, dimana dibutuhkan aspek kejelian dari seorang Notaris. Dan bagi para penyidik juga dalam hal penyidikan tidak salah arah,&rdquo; imbuh Kapolda.</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	Kapolda Jateng Ini mengharapkan kedepannya bisa bersinergi sehingga tugas Notaris selaku pejabat negara dan kepolisian sebagai penyidik dalam hal pelaksanaan tindak pidana dilapangan akan bekerja sama dengan baik sehingga tidak ada permasalahan yang menonjol dan tanpa bisa diselesaikan,&rdquo; tegas Kapolda mengakhiri bincang-bincangnya dengan Notary Magz.&nbsp;&nbsp;</div>\r\n<div style=\"text-align: justify;\">\r\n	&nbsp;</div>\r\n<div style=\"text-align: right;\">\r\n	sumber :&nbsp;<a href=\"https://notarymagazine.com/pengwil-jateng-ini-mou-dengan-polda-jateng/\">https://notarymagazine.com/pengwil-jateng-ini-mou-dengan-polda-jateng/</a></div>\r\n','yes','Rabu 16 September 2020','2020-09-16 10:31:56','0000-00-00 00:00:00',539),(16,'Sinergitas Polda & Notaris di Jawa Tengah','Sinergitas-Polda-Notaris-di-Jawa-Tengah-YouTube.jpg','<p>\r\n	<iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/iYznKpyg_5I\" width=\"100%\"></iframe></p>\r\n','yes','Jumat 18 September 2020','2020-09-18 15:59:27','0000-00-00 00:00:00',354),(17,'DAFTAR NAMA PESERTA MAGANG BERSAMA SEMESTER 4 (17 NOVEMBER 2020) PENGWIL JATENG IKATAN NOTARIS INDONESIA','','<p>\r\n	<strong><u>MAGANG BERSAMA SEMESTER 4</u></strong></p>\r\n<p>\r\n	<strong><u>PENGWIL JAWA TENGAH IKATAN NOTARIS INDONESIA</u></strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:792px;\" width=\"792\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:36px;\">\r\n				<p align=\"center\">\r\n					NO</p>\r\n			</td>\r\n			<td style=\"width:302px;\">\r\n				<p align=\"center\">\r\n