: center;\">\r\n	<span style=\"font-size:36px;\"><strong><span style=\"background-color:#ff0000;\">PENGUMUMAN</span></strong></span></p>\r\n<p style=\"text-align: center;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:18px;\">Kepada seluruh Peserta Seleksi ALB dan Magang bersama Pengwil Jateng INI Periode Februari 2021</span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:18px;\">Diumumkan bahwa nomor Handpone Contact Person Magang bersama Sdr. <strong>Sobir Mustakim Wibowo</strong> dengan Nomor HP/WA <strong>081391198488</strong> pada saat ini (28 Februari 2021) telah disalahgunakan oknum tidak bertanggungjawab atau telah diretas/<em>hacked, </em>dan beberapa calon peserta Magang Bersama telah dihubungi dan dimintai transfer uang pendaftaran ke rekening pribadi. Mohon untuk tidak ditanggapi, dan apabila calon peserta mengalami hal yang sama mohon untuk segera menghubungi panitia ( CP ALB : 085866830533 - Pande Putu Erma, CP Magber : 081329222300 - Wulan Andriani). Perlu kami tekankan bahwa pembayaran pendaftaran seleksi ALB dan Magang Bersama hanya ke rekening yang tercantum di flyer/brosur/web dan atas nama PENGWIL JATENG INI. </span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:18px;\">Segenap panitia mohon maaf atas ketidak nyamanannya, atas perhatiannya diucapkan terimakasih</span></p>\r\n<p style=\"text-align: center;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:18px;\">TTD</span></p>\r\n<p style=\"text-align: center;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:18px;\">PANITIA Seleksi ALB dan Magang Bersama</span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:18px;\">Pengwil Jateng INI</span></p>\r\n','no','Kamis 15 April 2021','2021-04-15 11:54:19','0000-00-00 00:00:00',1),(20,'DAFTAR NAMA PESERTA MAGANG BERSAMA SEMESTER 4 (18 FE