INSERT INTO `arf_other` VALUES (1,'konfirmasi_chekout','yes','yes','<p>\r\n	<strong>Terima Kasih telah berbelanja di Jendela Toko Buku.<br />\r\n	<br />\r\n	Ada Pertanyaan? Call 0272-329294</strong></p>\r\n<p>\r\n	<strong>Email : jendelabook@gmail.com / info@jendelabook.com</strong></p>\r\n<p>\r\n	<strong>Sms : 087734723000</strong></p>\r\n<p>\r\n	<strong>Pin BBM : 537E0DE4</strong></p>\r\n<p>\r\n	<strong>Pada Jam Kerja Senin-Sabtu Pkl 08.00 sd 16.00 WIB</strong></p>\r\n','','<ul style=\"margin-left:25px;line-height:25px;font-size:12px;\">\r\n	<li id=\"yui_3_7_2_1_1355291670087_3462\">\r\n		<span style=\"font-size:12px;\">Pembayaran melalui transfer ke rekening&nbsp;<b>BCA</b></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3260\">\r\n		<span style=\"font-size:12px;\">No. Rekening : <b>030.623.3399</b></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3461\">\r\n		<span style=\"font-size:12px;\">Atas nama : <b>Yahya Yunanta</b></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3449\">\r\n		<span style=\"font-size:12px;\">Atau</span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3450\">\r\n		<span style=\"font-size:12px;\">Pembayaran melalui transfer ke rekening&nbsp;<b>Mandiri</b></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3451\">\r\n		<span style=\"font-size:12px;\">No. Rekening : <b>138.000.1212.120</b></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3453\">\r\n		<span style=\"font-size:12px;\">Atas nama : <b>Yahya Yunanto</b></span></li>\r\n	<li>\r\n		<span style=\"font-size:12px;\">Atau</span></li>\r\n	<li>\r\n		<span style=\"font-size:12px;\">Pembayaran melalui transfer ke rekening <strong>BRI</strong></span></li>\r\n	<li>\r\n		<span style=\"font-size:12px;\">No. Rekening<strong> 0035.01035.082501</strong></span></li>\r\n	<li>\r\n		<span style=\"font-size:12px;\">Atas Nama : <strong>Yahya Yunanto</strong></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3455\">\r\n		<span style=\"font-size:12px;\">Cantumkan nomor order di berita transfer.</span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3456\">\r\n		<span style=\"font-size:12px;\">Setelah pembayaran dilakukan, konfirmasi ke<strong> 087734723000 (NO CALL, SMS ONLY)</strong>, jangan lupa cantumkan : nomor order + nama Bank (BCA/Mandiri/BRI)&nbsp; atau <strong>via Web Di Menu ACCOUNT DETAIL - Shopping History</strong></span></li>\r\n	<li id=\"yui_3_7_2_1_1355291670087_3457\">\r\n		<span style=\"font-size:12px;\">Bagi yang belum menjadi member, silahkan register terlebih dahulu sebagai Member<strong>&nbsp;</strong></span><strong>JENDELA TOKO BUKU</strong></li>\r\n</ul>\r\n<p>\r\n	<strong>____________________________________________________________________________</strong></p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><span style=\"color: rgb(255, 0, 0);\"><strong>Batas Waktu Transfer adalah 2 x 24 Jam, Jika dalam 2 x 24 Jam tidak ada Konfirmasi Transfer maka history pembelajaan akan kami Hapus/Cancel.</strong> <strong>Dikarenakan stok terbatas</strong>. <strong>Terima Kasih</strong></span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Salam </strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Jendela Toko buku</strong></p>\r\n','jendelabook@gmail.com','jendelabook@gmail.com','<p>\r\n	Yth Pelanggan jendelabook.com</p>\r\n<p>\r\n	Terima Kasih atas konfirmasinya. Kami akan segera mengirim barang pesanan anda secepatnya, setelah kami memastikan&nbsp; menerima pembayaran dari anda.</p>\r\n<p>\r\n	Kami akan segera mengirim No Resi JNE ke nomor atau email anda segera.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Salam</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Jendela Toko Buk</strong>u</p>\r\n','<p style=\"color: rgb(78, 78, 78); font-family: sans-serif; line-height: 18px;\">\r\n	Jl. Raya Solo - Sragen Km. 13,2<br />\r\n	Desa Pulosari, Kec. Kebakkaramat,<br />\r\n	Karanganyar, SOLO - 57762, Indonesia</p>\r\n','<p>\r\n	Lorem Ipsum is simply dummy text of the printing and typesetting.<br />\r\n	Telp (021) 5842888<br />\r\n	Fax. (021) 2854698<br />\r\n	www.loremipsum.com, info@loremlipsum.com</p>\r\n','logo_2_.png','<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3176.668390671241!2d106.82410399999998!3d-6.135874999999936!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e69f5f8a9441a4b%3A0x87b6e2c9988aa15f!2sRose+Nicole!5e1!3m2!1sen!2s!4v1398399386112\" width=\"509\" height=\"213\" frameborder=\"0\" style=\"border:0\"></iframe>','2015-11-06 13:39:41','0000-00-00 00:00:00');
