INSERT INTO `arf_seminar` VALUES (1,'Diklat Perbankan Syariah dan Konvensional 1 Februari 2020','no','WhatsApp Image 2020-01-14 at 06.40.52.jpeg','2020-01-30','<p>\r\n	* Pengurus Wilayah Jawa Tengah Ikatan Notaris Indonesia<br />\r\n	* Menyelenggarakan &quot; Pembekalan Notaris Perbankan Syariah dan Pembuatan Perjanjian Perbankan Syariah&quot; *(Sertifikat MUI dan Sertifikat Pengwil Jateng INI poin 4)*</p>\r\n<p>\r\n	Pelaksanaan : Hari : Sabtu 01 Februari 2020 Pukul : 08.00 WIB - selesai<br />\r\n	Tempat : Hotel Grasia Semarang<br />\r\n	*Dengan materi dan Pembicara :<br />\r\n	* - Kajian Hukum Perbankan Syariah dan Problematika Pengawasan Perbankan Syariah Oleh *Majelis Ulama Indonesia Jawa Tengah.<br />\r\n	* - Kajian Hukum Perbankan dan Problematika Akta Notaris dalam Bidang Perbankan Oleh *Otty Hari Chandra Ubayani,SH, MH, Sp.N.<br />\r\n	* - Kajian Pengawasan dan Penindakan dalam Praktik Perbankan Syariah oleh *OJK* - Kajian Hukum Khusus terkait Suap, Pungli dan Gratifikasi di Bidang Perbankan Oleh</p>\r\n<p>\r\n	*Kontribusi :<br />\r\n	* Mahasiswa/Alb : Rp. 500.000 Notaris/Umum : Rp. 750.000 Go Show : Rp. 1.000.000 (bila masih ada kuota)<br />\r\n	Kontribusi dapat ditransfer melalui <strong>*Bank, BNI 3131101077* an Pengwil Jateng INI </strong></p>\r\n<p>\r\n	*Fasilitas* : - *Sertifikat Perbankan Syariah* - *Sertifikat Pengwil Poin 4* - Modul (Soft Copy + Draf Akta Perbankan Syariah) - Coffe break - Lunch</p>\r\n<p>\r\n	*<strong>PENDAFTARAN PALING LAMBAT 30 Januari 2020</strong>*<br />\r\n	*Contact Person :<br />\r\n	1. Daror Mujahidi (08112700969)<br />\r\n	2. Fitriana Bawazier (082327602969)<br />\r\n	3. Nur Sofiatun (081332696357)</p>\r\n','2020-03-20 09:55:02','0000-00-00 00:00:00'),(2,'BIMBEL UJIAN KODE ETIK NOTARIS','no','bimbel uken.png','2020-11-23','<p>\r\n	PENDAFTARAN AKAN DI TUTUP OTOMATIS APABILA JUMLAH PENDAFTAR SUDAH MEMENUHI KUOTA MAKSIMAL 100 ORANG</p>\r\n','2020-11-12 20:38:32','0000-00-00 00:00:00');
