INSERT INTO `arf_texthome` VALUES (1,'SAMBUTAN KETUA UMUM PENGURUS PUSAT IPPAT ','DR. SYAFRAN SOFYAN, SH, SpN, MHum.','yes','FOTO SS.JPG','<p style=\"text-align: justify;\">\r\n	Assallamualaikum wm.wb, salam sejahtera bagi kita semua.<br />\r\n	Om swasti astu.</p>\r\n<p style=\"text-align: justify;\">\r\n	Yth ketua pengwil ippat jateng, dan seluruh pengurus, mkw ippat, ketua dan pengurus daerah ippat se-jawa tengah, dan seluruh ppat jawa tengah yang berbahagia.</p>\r\n<p style=\"text-align: justify;\">\r\n	Pertama-tama marilah kita panjatkan puji syukur kehadirat allah swt, karena kita dapat berkumpul disini, dan selamat kami ucapkan atas lauching webIPPAT Jawa Tengah.</p>\r\n<p style=\"text-align: justify;\">\r\n	Kami sangat berharap, peluncuran web ippat jateng ini, akan meningkatkan informasi dan komunikasi antara pengurus dan anggota, sehingga untuk mewujudkan ippat baru dan besar akan mudah terwujud.</p>\r\n<p style=\"text-align: justify;\">\r\n	(Baru singkatan: B=Bangkit, R=Regenerasi, U=Unggul. &nbsp; Besar: B=Bersatu, S=Santun, R=Penuh kekeluargaan)</p>\r\n<p style=\"text-align: justify;\">\r\n	Untuk tambahan informasi, sebentar lagi kita akan mengadakan upgrading dan rakernas ii ippat di bali, pada tanggal 28-29 april 2017,adapun tema rakernas ii ippat :</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>&ldquo;melalui rakernas ii ippat kita tingkatkan semangat berorganisasi yang beretika dan ppat profesional guna mewujudkan ippat baru dan besar&rdquo;</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	Di dalam upgrading dan rakernas, kita pengurus pusat selaku penyelenggara, semaksimal mungkin memberikan penyegaran ilmu pengetahuan, pembinaan anggota, termasuk juga yang berkaitan dengan pelayanan di kantor pertanahan, insya allah akan diluncurkan launching sistem pelayanan online, penyerahan keputusan menteri atr/bpn ri terkait dengan kode etik ppat, serta mou/kerja-sama dengan ppatk dan pihak maskapai garuda.</p>\r\n<p style=\"text-align: justify;\">\r\n	Termasuk juga materi yang disajikan, terkait dengan kebijakan kementerian atr/bpn ri, sistem pendaftaran online, permasalahan/sengketa pertanahan yang terkait dengan ppat, kebijakan peraturan perpajakan selama ini, kebijakn perbankan, pelaksanaan penegakan hukum terkait ppat, dan saber pungli, termasuk yang berkaitan dengan penguatan, dan etika berorganisasi oleh majelis kehormatan pusat dan ketua penasehat pp ippat.</p>\r\n<p style=\"text-align: justify;\">\r\n	Mudah-mudahan, kedepan, tidak ada lagi hambatan, persoalan yang terkait dengan pelayanan, pendaftaran di kantor pertanahan, pembayaran pajak;khususnya yang terkait dengan validasi, karena kedepan akan diadakan validasi online, termasuk juga persoalan, perlindungan,dan proteksi terhadap ppat ; kalau ppat dipersangkakan oleh penegak hukum, ada yang membantu /proteksi dan melayani; dan pembinaan/pengawasan oleh majelis pengawas ppat.</p>\r\n<p style=\"text-align: justify;\">\r\n	Berkaitan dengan penguatan organisasi ikatan pejabat pembuat akta tanah (ippat),selalu mendorong, baik dengan melakukan pembinaan ke seluruh indonesia, (33 pengwil dan 275 pengda) diseluruh indonesia, termasuk dengan instansi terkait; bekerja-sama dengan semua stakeholder ippat, khususnya dengan kementerian atr/bpn ri; alhamdulillah, saat ini, organisasi ippat sudah diakui oleh kementerian atr/bpn ri, satu-satunya organisasi ppat, dan sudah dicantumkan juga di dalam keputusan/peraturan yang dibuat oleh kementerian atr/bpn ri.</p>\r\n<p style=\"text-align: justify;\">\r\n	Termasuk diajak dalam pembahasan peraturan menteri yang terkait dengan ppat, ikut sebagai pengawas ujian ppat; dan insya alalah, juga akan diadakan penyerahan keputusan menteri atr/ka.bpn ri terkait dengan kode etik ppat, diklat/kode etik calon ppat sebagai syarat pengangkatan ppat, dan juga saat ini sedang dibahas peraturan menteri terkait dengan majelis pengawas ppat. (saat ini pertumbuhan calon ppat, 2000 an per tahun).</p>\r\n<p style=\"text-align: justify;\">\r\n	Dengan lembaga penegak hukum; polri, kejaksaan agung, ma, kpk, ombudsman, ppatk, peradi, dan saber pungli, kita selalu mengadakan koordinasi, pembinaan bersama, termasuk kerja-sama/mou; agar kedepan adanya saling pengertian, adanya kesamaan persepsi, saling memberikan keahlian, dan pendidikan bersama.</p>\r\n<p style=\"text-align: justify;\">\r\n	Kita juga berkoordinasi dengan dewan ketahanan nasional (wantanas) yang di pimpin langsung oleh presiden ri, pelaksana sekjen wantanas ri, memberikan masukan terkait dengan pertanahan dan perpajakan.</p>\r\n<p style=\"text-align: justify;\">\r\n	Juga terkait dengan pajak, kita juga selalu berkoordinasi dengan ditjen pajak, melakukan pembinaan dengan pejabat pajak di pusat, dan daerah, juga dengan pemerintah daerah, gubernur, bupati, skpd, terkait dengan pajak daerah, validasi, nilai objek pajak, dan lain-lain.</p>\r\n<p style=\"text-align: justify;\">\r\n	Untuk meningkatkan mutu/kwalitas calon ppat, kita sudah melakukan mou/kerja-sama dengan asosiasi prodi mkn baik ptn/pts, serta melakukan mou, kuliah umum, seminar ke-ppat-an, hampir semua mkn seluruh indonesia (32 prodi mkn); dan diklat calon ppat (sebelum lulus ujian ppat).</p>\r\n<p style=\"text-align: justify;\">\r\n	Berkaitan dengan eksistensi ppat/ippat kedepan, kita juga melakukan koordinasi, rapat dengar pendapat dengan komisi ii dpr ri, balegnas dpr ri, berkaitan dengan ruu ppat, alhamdulillah saat ini sudah masuk di prolegnas, dengan nomor urut 168. Dan sekarang sudah dibentuk tim perumus ruu ppat dan pertanahan. Di dalam pp no.24 th 2016 ttg ppat, ada 8 kewenangan ppat di dalam membuat akta otentik, dan transaksi yg dilakukan ppat, nilainya ribuan triliun rupiah per tahun, dan terkait dengan banyak instansi/lembaga negara, termasuk pemda.</p>\r\n<p style=\"text-align: justify;\">\r\n	Masih banyak lagi yang telah dilakukan ippat, tentunya tanpa bantuan, dorongan, suport dari teman-teman pengurus, baik di pusat, wilayah, daerah, dan seluruh ppat di indonesia, maka tidak ada artinya. Berkaitan dengan semangat berorganisasi, dan etika kepemimpinan, dalam berorganisasi, maka kami sangat mengharapkan, bagaimana kedepan ada perbaikan secara terus menerus di dalam anggaran dasar , dan anggaran rumah tangga (ad/art ippat), agar adanya semangat berorganisasi, kaderisasi, dan etika kepemimpinan, koordinasi, dan komunikasi di dalam berorganisasi, hubungan pp, pengwil dan pengda.</p>\r\n<p style=\"text-align: justify;\">\r\n	Di dalam etika kepemimpinan, kedepan tidak ada lagi calon pemimpin yang mundur, demi mengejar/bagi-bagi&nbsp; kekuasaan, tidak ada lagi calon, pemimpin, pengurus ippat yang pernah/tersandung masalah hukum, atau pernah berurusan dengan hukum.</p>\r\n<p style=\"text-align: justify;\">\r\n	Saat ini, alhamdulillah, kita pengurus pusat, sudah melaksanakan 32 konferwil, termasuk pembinaan di 32 pengurus wilayah tersebut, dan lebih dari 275 pengurus daerah yang telah ketua umum beserta jajaran kunjungi, untuk melakukan pembinaan bersama-sama dengan instansi terkait, termasuk dengan penegak hukum.</p>\r\n<p style=\"text-align: justify;\">\r\n	Kabinet ippat saat ini, adalah kabinet persatuan, kalo mau bersatu, harus kita tunjukan, nyatakan, baik dalam kepengurusan, perbuatan, etika dan sikap tindak kita,inilah saatnya kebangkitan ippat,ppat, dengan menegakan wibawa dan kehormatan ppat/ippat, kita berdiri sejajar, dan bermitra dengan pemerintah dan semua elemen bangsa.</p>\r\n<p style=\"text-align: justify;\">\r\n	Ppatmerupakan bagian dari pemerintahan, khususnya dibidang pertanahan, bagaimana ikut menciptakan sistem pemerintahan yang baik (goodgovernance), pp ippat selalu berkoordinasi, rapat bersama dengan kementerian atr/bpn ri, dpr ri, bkpm, ditjen pajak, menpan&amp; reformasi birokrasi, kpk, ppatk, ombudsman,mahkama agung, kejaksaan agung, kepolisian, perguruan tinggi, itu semua tidaklah ada artinya, tanpa adanya persatuan, dan dukungan dari seluruh ppat, pengwil dan pengda, serta semangat tekat dari kita semua untuk berubah dan bangkit, sehingga kita harapkan kedepan terciptalah martabat, dan kehormatan ppat, &nbsp;clean government, dan juga selalu mendorong tercapainya sistem pelayanan yang berbasis it (online), khususnya di kantor pertanahan, dan perpajakan, serta pemerintah daerah.</p>\r\n<p style=\"text-align: justify;\">\r\n	Dalam hal. Komunikasi, dan koordinasi dengan anggota, ppat diseluruh indonesia, kita buka seluas-luasnya, dengan melakukan pembinaan bersama, sampai kedaerah, kita berharap semua pengurus dapat turun kelapangan, melayani anggotanya;</p>\r\n<p style=\"text-align: justify;\">\r\n	Sehingga semua persoalan, permasalahan anggota cepat diketahui dan diselesaikan. Kami apresiasi kepada pengwil, pengda yang telah mengadakan road show perlindungan ppat,melakukan pembinaan bersama dengan instansi terkait, bagi yang belum, dihimbau agar segera diadakan, untuk kemanfaat&nbsp; dan perlindungan anggota.</p>\r\n<p style=\"text-align: justify;\">\r\n	Kita juga berharap kepada seluruh ppat, agar ikut aktif setiap kegiatan yang dilakukan oleh pengurus pusat, pengwil dan pengda ippat, dan adanya koordinasi secara berjenjang dalam kegiatan tersebut,yang mana sangat bermanfaat,dapat menambah wawasan, dan keilmuan, yang melahirkan ppat yang profesional dan juga untuk jalannya roda organisasi, ppat diharapkan aktif dalam membayar iuran anggota, karena itu kewajiban sebagai anggotadan adanya kerja-sama yang baik antara pengda-pengwil dan pp ippat dalam iuran anggota ini, karena ini kewajiban anggota,; dan dihimbau juga kepada seluruh pengda ippat, untuk menyalurkan 20% iuran tsb kepada pp ippat (sesuai ad,art ippat).</p>\r\n<p style=\"text-align: justify;\">\r\n	Masih banyak saat ini, kegiatan ke-ppat-an yang dilakukan diluar ippat, untuk itulah seluruh kegiatan yang dilakukan oleh ippat, akan ada point, agar dapat memotivasi anggota ikut di dalam kegiatan ippat, dan mohon kepada bapak menteri atr, rekomondasi dari, pengda, pengwil dan pp ippat, sebagai syarat di dalam perpindahan anggota, dan perpanjangan pensiun ppat.</p>\r\n<p style=\"text-align: justify;\">\r\n	Sekarang ini juga kita sedang menyusun data base ppat, karena sampai sekarang kita tidak tahu berapa jumlah pasti ppat di indonesia? Masih banyak selama ini, ppat yang tidak punya kta, sulit mengurus kta, dan kta selama ini kurang begitu bermanfaat, untuk itulah pp ippat, dan pada saat rakernas ini, dapat membuat kta, tidak ada lagi ppat yang tidak punya kta,pembuatan kta dapat dibuat dengan online, dan dapat juga dibuat pada saat rakernas ini. Kta kedepan, wajib &nbsp;digunakan disetiap kegiatan, acara ippat, sehingga tidak perlu lagi setiap acara kita meminta data ppat. Dan juga kta tersebut, mempunyai manfaat lain, yakni adanya diskon di penerbangan, kereta api, hotel, rumah sakit, asuransi, yang telah bekerja-sama dengan pp ippat; dan dimohon juga kepada kementerian atr/bpn ri, agar kta ippat baru ini sebagai syarat di dalam pendaftaran, kerja-sama dengan instansi, perbankan, dan lain-lain; dan juga yang terkait dengan pp nomor 24 th 2016, khususnya yang mengatur wilayah jabatan ppat, formasi ppat, agar juga dapat dituntaskan.</p>\r\n<p style=\"text-align: justify;\">\r\n	Dari hal itu semua, kami tentunya perlu dukungan seluruh ppat, pengda ippat, pengwil ippat di seluruh indonesia, semua kementerian, lembaga penegak hukum, dpr, stakeholder, khususnya kementerian atr/bpn, untuk mewujudkan visi, misi tersebut, yang sangat bermanfaat buat kepentingan seluruh ppat, agar kedepan tidak ada lagi anggota-ppat yang tersangkut masalah hukum, tanpa adanya kesalahan yang jelas, dan juga pelayanan di kantor pertanahan, pajak, pemda menjadi lebih baik, good dan clean governance, yang berbasis online/it.</p>\r\n<p style=\"text-align: justify;\">\r\n	Tentunya demi kemanfaatan, dan tetap menjaga integritas organisasi ippat, diharapkan dapat melakukan perbaikan art ippat, perbaikan organisasi, semangat berorganisasi, etika kepemimpinan, termasuk kesatuan sikap ippat, agar wibawa dan harkat, martabat ppat tetap terjaga, dan alhamdulillah, pada tgl 27 maret 2017, nama organisasi ikatan pejabat pembuat akta tanah (ippat) telah resmi terdaftar di data base sismibakum kemenkumham, dan anggaran dasar terakhir telah di sahkan, sebagai badan hukum.</p>\r\n<p style=\"text-align: justify;\">\r\n	Dalam kesempatan ini, saya selaku ketua umum pp ippat, mengucapkan selamat atas launching web ippat jawa tengah, semoga berjalan dengan lancar, dapat memberikan sumbangsi buat kemajuan dan kemanfaatan ippat dan ppat kedepan.</p>\r\n<p style=\"text-align: justify;\">\r\n	Sekian, terimah-kasih, wass.wm.wb, om santi-santi om.</p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>KETUA UMUM PP IPPAT</strong><br />\r\n	TTD</p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>DR. SYAFRAN SOFYAN, SH, SpN, MHum.</strong></p>\r\n','<p>\r\n	&nbsp;</p>\r\n<p style=\"text-align: left;\">\r\n	<iframe frameborder=\"0\" height=\"60\" src=\"https://jam.jadwalsholat.org/digitalclock/\" width=\"100%\"></iframe><br />\r\n	<iframe frameborder=\"0\" height=\"220\" src=\"https://www.jadwalsholat.org/adzan/ajax.row.php?id=232\" width=\"100%\"></iframe></p>\r\n','2017-06-03 11:40:19','0000-00-00 00:00:00');
